(5726, 872, 'park_headline', 'Tourist Park in Deniliquin'),
(5727, 872, '_park_headline', 'field_56b2c3717d1af'),
(5728, 872, 'park_description', 'Nestled along the banks of the Edward River, alongside the sandy shore of NSW\'s largest inland river beach, lies McLean Beach Holiday Park, Deniliquin. Surrounded on three sides by the broad and tranquil Edward River, the park is a private water lovers paradise, perfect for fishing, water skiing or just relaxing by the beach. There is a large boat ramp at the entrance of the park and plenty of space for boat parking within.'),
