(5815, 876, '_park_headline', 'field_56b2c3717d1af'),
(5816, 876, 'park_description', 'Marysville Caravan and Holiday Park has something for everyone. Relax by the river and enjoy the mountain views, bird life and the best of nature. We are set at the foot of Lake Mountain in the heart of Marysville. The perfect location for snow activities, walking tracks, a round of golf, fishing or mountain bike riding. Of course, you may just choose to sit by the river which meanders through the middle of the holiday park and relax.'),
