(6174, 887, 'park_headline', 'Tourist Park, Long Term Holiday Sites in Alexandra'),
(6175, 887, '_park_headline', 'field_56b2c3717d1af'),
(6176, 887, 'park_description', 'This immaculately kept family caravan park is just the spot you’re looking for, set in beautiful valleys surrounded by rolling hills and the pristine, fish filled, Goulburn River. The Park is only a 5 minute drive form the Alexandra township and is hidden away, surrounded by farm lands occupied by meandering cows and grazing sheep. It’s as if time stops when you enter this place, your senses are filled with the crisp scent of the Australian eucalypt. The sparkling cool waters of the Goulburn River are heaven sent during those hot summer days.'),
