(7878, 1420, 'section_content_1_content', 'Looking at joining the Tourism Industry?\r\n\r\nTower Business &amp; Robinsons Real Estate is Australia\'s largest Caravan Park, Motel and Business Brokerage Firm. Director Sam Symes and the Tower Team of Ricky Symes, Allan Walls and Michael Fox bring an enviable track record in the sale of Leasehold and Freehold Caravan Parks, Motels and large businesses.\r\n\r\nWith over 56 years specialising in Caravan Park and Motel sales, Tower has high profile acceptance amongst the Business Community Australia wide.\r\n\r\n<strong>Tower Business &amp; Robinsons Real Estate..... Nothing Beats Experience!</strong>\r\n\r\n<a href="http://www.towerrobinsons.com.au/">http://www.towerrobinsons.com.au/</a>'),
