(7905, 1420, 'section_content_2_content', 'Innovation and quality you can trust\r\n\r\nFor over 25 years, Jayco has been creating Leisure Home and Park Cabins for holiday parks across Australia. Jayco places an emphasis on quality, design and usable space with our Leisure Homes. The buildings are available in one, two or three bedroom designs with good-sized showers and toilet facilities. There is also the option for top-of-the-range models that include built-in spas and luxury appliances. Jayco’s design team can also work with park operators to create Leisure Homes that are built to an agreed theme and budget. Invest in a Jayco Leisure Home or Park Cabin with peace of mind knowing you’re getting innovative design, a quality build and ongoing support.\r\n\r\n<a href="http://www.jayco.com.au">www.jayco.com.au</a>'),
(7906, 1420, '_section_content_2_content', 'field_56d684eabc72d'),
(7907, 1420, 'section_content_3_image', '1440'),
(7908, 1420, '_section_content_3_image', 'field_56d684d7bc72b'),
(7909, 1420, 'section_content_3_heading', 'Diamond Sponsor - Madgwicks, Lawyers'),
(7910, 1420, '_section_content_3_heading', 'field_56d684e6bc72c'),
(7911, 1420, 'section_content_3_content', 'Madgwicks is a Melbourne-based business law firm, providing high quality legal advice to clients of all sizes and sectors, including working extensively with caravan parks and the tourism industry more broadly.\r\n\r\nMany of our lawyers are from regional areas, have worked with regional law firms and some also maintain working farms in rural Victoria. This means we have a unique understanding of the regional tourism environment and its challenges.\r\n\r\nMadgwicks is also part of Meritas, one of the world\'s largest international affiliations of independent law firms. This alliance provides Madgwicks\' clients with access to 160+ lawyers in 6 firms across Australia and New Zealand and a global network of 6,900 lawyers in more than 80 countries around the world.\r\n\r\n<a href="http://www.madgwicks.com.au">www.madgwicks.com.au</a>'),
(7912, 1420, '_section_content_3_content', 'field_56d684eabc72d'),
(7913, 1420, 'section_content_4_image', '1441'),
(7914, 1420, '_section_content_4_image', 'field_56d684d7bc72b'),
(7915, 1420, 'section_content_4_heading', 'Diamond Sponsor - Newbook EManagement Technology'),
(7916, 1420, '_section_content_4_heading', 'field_56d684e6bc72c'),
(7917, 1420, 'section_content_4_content', 'NewBook eManagement Technology is the latest reservation system designed primarily for Holiday Parks. Built from the ground up as a web-based, cloud hosted system, NewBook automates many day-to-days tasks and can be accessed from any computer or mobile device with a web browser, eliminating the need for expensive on-site servers.\r\n\r\nBradley Illich, founder of NewBook, grew up as the youngest of a family of 6 owning and operating two multi-award winning holiday parks Ashmore Palms Holiday Village &amp; Brisbane Holiday Village. NewBook has been developed with feedback from holiday park managers and is gaining traction in the industry very quickly.'),
(7918, 1420, '_section_content_4_content', 'field_56d684eabc72d'),
(7919, 1420, 'section_content_5_image', '1442'),
(7920, 1420, '_section_content_5_image', 'field_56d684d7bc72b'),
(7921, 1420, 'section_content_5_heading', 'Diamond Sponsor - PlayRope Group of Companies'),
(7922, 1420, '_section_content_5_heading', 'field_56d684e6bc72c'),
(7923, 1420, 'section_content_5_content', 'The PlayRope Group leads the outdoor playground market in Australia. Exclusive distributor relationships with the world’s best manufacturers of a wide range of outdoor and aquatic play equipment ensures PlayRope offers the very best products, designed and built to suit local conditions.\r\n\r\nOur display stand has information on new products we have available that are perfectly suited to caravan parks. We also have the brand new Vortex Aquatics catalogue which features great ideas and themes to turn your park into an aquatic paradise. Make sure you come and say hello to the PlayRope team.\r\n\r\n<a href="http://www.playrope.com.au/">www.playrope.com.au</a>\r\n\r\n<a href="http://www.vortexaquaticplaygrounds.com.au">www.vortexaquaticplaygrounds.com.au</a>\r\n\r\n<a href="http://www.iplaygrounds.com.au">www.iplaygrounds.com.au</a>\r\n\r\nE: <a href="http://info@playrope.com.au">info@playrope.com.au</a>\r\n\r\nPh: 1800 767 529'),
(7924, 1420, '_section_content_5_content', 'field_56d684eabc72d'),
(7925, 1420, 'section_content_6_image', '1443'),
(7926, 1420, '_section_content_6_image', 'field_56d684d7bc72b'),
