INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(7928, 1420, '_section_content_6_heading', 'field_56d684e6bc72c'),
(7929, 1420, 'section_content_6_content', 'RMS Hospitality Solutions features a suite of cloud-based technology solutions that streamline and simplify holiday park operations Dubbed "The Hospitality Cloud," these tools enable park owners operate their front desk, online booking, channel management, guest marketing, business intelligence, tour desk and other systems without reliance on hardware or IT infrastructure. No need for complicated networks or worrying about back-ups, updates and data security. More than 5,000 properties in 25 countries currently rely on RMS for their property solutions.\r\n\r\n<a href="http://www.rms.com.au">www.rms.com.au</a>\r\n\r\n(03) 8399 9462'),
(7930, 1420, '_section_content_6_content', 'field_56d684eabc72d'),
(7931, 1420, 'section_content_7_image', '1444'),
(7932, 1420, '_section_content_7_image', 'field_56d684d7bc72b'),
(7933, 1420, 'section_content_7_heading', 'Diamond Sponsor - Todd Devine Homes'),
(7934, 1420, '_section_content_7_heading', 'field_56d684e6bc72c'),
(7935, 1420, 'section_content_7_content', 'Todd Devine Homes is a leader in the design and construction of transportable homes, granny flats and holiday park cabins. With over 20 years’ experience, Todd Devine is a company built on quality service and customer care.\r\n\r\nAt Todd Devine, our cabins are designed to enhance every minute of your guests stay. Our aim is to bring people closer together, allow them to share wonderful moments and create memories to last a lifetime. It’s a simple thing. But it guides every decision we make – and it differentiates us from almost every other cabin manufacturer. Call us now – (03) 9720 1686.\r\n\r\n&nbsp;\r\n\r\n<a href="http://www.todddevine.com.au/">http://www.todddevine.com.au/</a>'),
(7936, 1420, '_section_content_7_content', 'field_56d684eabc72d'),
(7937, 1420, 'section_content_8_image', '1445'),
(7938, 1420, '_section_content_8_image', 'field_56d684d7bc72b'),
(7939, 1420, 'section_content_8_heading', 'Platinum Sponsor - Grampians Insurance Brokers'),
(7940, 1420, '_section_content_8_heading', 'field_56d684e6bc72c'),
(7941, 1420, 'section_content_8_content', 'As an insurance broker, Grampians Insurance Brokers works for you – NOT the insurance company.\r\n\r\nDavid and the team spend the time to evaluate all your personal circumstances and needs, and then find the policy that best suits your situation. It’s a specifically tailored process that ensures you have the right amount of coverage.\r\n\r\nAnd being experts in the industry, the team are able to decipher policy wordings and the complicated terminology that, as customers, we sometimes overlook or don’t understand.\r\n\r\nGrampians Insurance Brokers save you the time and energy of ringing around numerous insurance companies, trying to compare policies and prices.\r\n\r\nBut here’s the most important point – when you have a claim remember they are working for you. All that arguing over the fine print – they do it for you.\r\n\r\n<a href="http://www.grampiansinsurance.com.au">www.grampiansinsurance.com.au</a>'),
(7942, 1420, '_section_content_8_content', 'field_56d684eabc72d'),
