(7977, 1420, 'section_content_9_image', '1446'),
(7978, 1420, '_section_content_9_image', 'field_56d684d7bc72b'),
(7979, 1420, 'section_content_9_heading', 'Platinum Sponsor - K-Mac Powerheads'),
(7980, 1420, '_section_content_9_heading', 'field_56d684e6bc72c'),
(7981, 1420, 'section_content_9_content', 'K-Mac Powerheads have been proud Australian manufacturers of power supply pillars for Caravan Parks for over 50 years.\r\n\r\nOur products range is of the highest quality and conforms to all Australian Electrical Standards giving you and your customers’ peace of mind.\r\n\r\nIf you can’t find what you’re looking for in our standard range, we’ll build it for you, custom made!\r\n\r\nWe’re committed to driving industry innovation that adds value to both our customers and the industry overall.\r\n\r\nK-Mac Powerheads is a long time sponsor and supporter of every State Association, Big4, Family Parks, Top Tourist, and a foundation contributor to CRVA.\r\n\r\nCome and visit us in the Trade Expo!\r\n\r\n<a href="http://www.kmacpowerheads.com.au">www.kmacpowerheads.com.au</a>'),
(7982, 1420, '_section_content_9_content', 'field_56d684eabc72d'),
(7983, 1420, 'section_content_10_image', '1447'),
(7984, 1420, '_section_content_10_image', 'field_56d684d7bc72b'),
(7985, 1420, 'section_content_10_heading', 'Platinum Sponsor - Rigby Cooke Lawyers'),
(7986, 1420, '_section_content_10_heading', 'field_56d684e6bc72c'),
(7987, 1420, 'section_content_10_content', 'Rigby Cooke Lawyers has a dedicated team, servicing the diverse legal requirements of the caravan and parks industry. Our team is led by Tim Kelly who has represented the interests of Victorian Caravan Park owners for more than 25 years.\r\n\r\nOur extensive experience in property, business, commercial, planning and litigation law combined with our detailed understanding of the industry, means we provide proactive advice on all facets of buying, selling, leasing and operating a caravan park.\r\n\r\nWe specialise in negotiating and drafting project specific contracts, advising on contractual claims and strategies and providing dispute resolution advice including court and VCAT hearing representation.\r\n\r\n<a href="http://www.rigbycooke.com.au">www.rigbycooke.com.au</a>'),
(7988, 1420, '_section_content_10_content', 'field_56d684eabc72d'),
(7989, 1420, 'section_content_11_image', '1448'),
(7990, 1420, '_section_content_11_image', 'field_56d684d7bc72b'),
(7991, 1420, 'section_content_11_heading', 'Gold Sponsor - All Parks Insurance'),
(7992, 1420, '_section_content_11_heading', 'field_56d684e6bc72c'),
(7993, 1420, 'section_content_11_content', 'Julie Pernecker, formerly manager of Parks Insurance, has now headed up All Parks Insurance. Before selling Parks Insurance to Lumley, Julie and her father Robert Meyer had established themselves as the parks and resorts industry insurance specialists.\r\n\r\nWith All Parks Insurance Julie’s aim is to provide the Caravan Park industry with a superior and specialised wording and the old fashioned service we all deserve. She is prepared to ride out the good with the bad and travel the journey with the industry. Julie has over 15 years experience in insuring Caravan Parks and meeting their every day insurance needs.\r\n\r\nAll Parks Insurance are the No. 1 Insurer for Caravan Parks in Australia and now offer Management Liability.\r\n\r\n<a href="http://allparks.com.au">http://allparks.com.au</a>'),
(7994, 1420, '_section_content_11_content', 'field_56d684eabc72d'),
(7995, 1420, 'section_content_12_image', '1449'),
(7996, 1420, '_section_content_12_image', 'field_56d684d7bc72b'),
(7997, 1420, 'section_content_12_heading', 'Gold Sponsor - Caravan Trade & Industries Association of Victoria'),
(7998, 1420, '_section_content_12_heading', 'field_56d684e6bc72c'),
(7999, 1420, 'section_content_12_content', 'The Caravan Trade &amp; Industries Association of Victoria has been the voice of Victoria’s caravan and camping industry since 1952. It was formed by a group of caravan manufacturers, hirers and private individuals with a keen interest in the “family lifestyle” caravanning offers.\r\n\r\nCIA Victoria aims to constantly grow the caravan and camping industry in Victoria through actively promoting the economic and lifestyle benefits of outdoor recreational experiences to the general public.\r\n\r\n<a href="http://ciavic.com.au">http://ciavic.com.au</a>'),
(8000, 1420, '_section_content_12_content', 'field_56d684eabc72d'),
(8001, 1420, 'section_content_13_image', '1450'),
(8002, 1420, '_section_content_13_image', 'field_56d684d7bc72b'),
(8003, 1420, 'section_content_13_heading', 'Gold Sponsor - Christie Parksafe'),
(8004, 1420, '_section_content_13_heading', 'field_56d684e6bc72c'),
(8005, 1420, 'section_content_13_content', 'Christie Parksafe’s most recent innovation, the CCQ cooktop, has raised the bar even higher. This has been endorsed by our recent Australian International Good Design Award.\r\n\r\nFurther to this, we also have a new unique range of recycled products, including park furniture, decking, bollards and signs.\r\n\r\nFor enquiries, please contact us on 1300 135 227, or email <a href="http://sales@christieparksafe.com.au">sales@christieparksafe.com.au</a>. Find us online at <a href="http://www.christieparksafe.com.au">www.christieparksafe.com.au</a>'),
(8006, 1420, '_section_content_13_content', 'field_56d684eabc72d'),
(8007, 1420, 'section_content_14_image', '1451'),
(8008, 1420, '_section_content_14_image', 'field_56d684d7bc72b'),
(8009, 1420, 'section_content_14_heading', 'Gold Sponsor - CRE Brokers'),
(8010, 1420, '_section_content_14_heading', 'field_56d684e6bc72c'),
(8011, 1420, 'section_content_14_content', 'CRE Brokers are specialist tourism brokers in the sale of Caravan Parks, both with business and property.\r\n\r\nWe have offices stretching from Townsville to Tasmania and pride ourselves on our ability to successfully navigate our clients through the sale process. We can advise on sale strategies and realistic selling prices.\r\n\r\n<a href="http://www.crebrokers.com">www.crebrokers.com</a>'),
(8012, 1420, '_section_content_14_content', 'field_56d684eabc72d'),
(8013, 1420, 'section_content_15_image', '1452'),
(8014, 1420, '_section_content_15_image', 'field_56d684d7bc72b'),
(8015, 1420, 'section_content_15_heading', 'Gold Sponsor - GSDM Marketing'),
(8016, 1420, '_section_content_15_heading', 'field_56d684e6bc72c'),
(8017, 1420, 'section_content_15_content', 'GSDM Marketing (Great Southern Destinations Marketing) is a medium sized full-service agency, with extensive in-house production services.\r\n\r\nWe specialise in developing integrated marketing campaigns for the tourism industry, our campaigns are tailored to your specific requirements and budget. Our services include:\r\n<ul>\r\n	<li>Brand development</li>\r\n	<li>Development of brochures &amp; flyers</li>\r\n	<li>Website development</li>\r\n	<li>App development</li>\r\n	<li>Multi-media production (filming &amp; editing)</li>\r\n	<li>eDM\'s (Online e-postcards &amp; e-newsletters)</li>\r\n</ul>\r\nWith over 20 years marketing experience, we invite you to give us a call to discuss your marketing needs. T. (03) 5223 2918\r\n\r\n<a href="http://www.gsdm.com.au">www.gsdm.com.au</a>'),
(8018, 1420, '_section_content_15_content', 'field_56d684eabc72d'),
(8019, 1420, 'section_content_16_image', '1453'),
(8020, 1420, '_section_content_16_image', 'field_56d684d7bc72b'),
(8021, 1420, 'section_content_16_heading', 'Gold Sponsor - Jumping Pillows'),
(8022, 1420, '_section_content_16_heading', 'field_56d684e6bc72c'),
(8023, 1420, 'section_content_16_content', 'Jumping Pillows® – if experience counts…\r\n\r\nOur company Jumping Pillows® was introduced to the holiday industry in Australia in 2003. There are now over 500 Jumping Pillows® all over the nation and with the trademark known in nine other countries it provides a solid marketing benefit to you. We are also known for introducing exiting products like pedal karts or playing fields from Denmark.\r\n\r\nThis year we are introducing a new brand of pedal karts - DINO (made in Germany), as well as some American products that will be loved by young and old.\r\n\r\nPlease call (07) 5471 7659 or see our website <a href="http://www.jumpingpillows.com.au">www.jumpingpillows.com.au</a>'),
(8024, 1420, '_section_content_16_content', 'field_56d684eabc72d'),
(8025, 1420, 'section_content_17_image', '1454'),
(8026, 1420, '_section_content_17_image', 'field_56d684d7bc72b'),
(8027, 1420, 'section_content_17_heading', 'Gold Sponsor - Map Coffee'),
(8028, 1420, '_section_content_17_heading', 'field_56d684e6bc72c') ;
INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(8029, 1420, 'section_content_17_content', 'Map Coffee was established in 2002 and has developed into a national business servicing cafes, major corporate organisations and community clubs across Australia. Part of Tata Global Beverages, Map Coffee can cater to any hot beverage need with a selection of quality Tetley teas and Map coffee products.\r\n\r\n<a href="http://www.mapcoffee.com.au">http://www.mapcoffee.com.au</a>'),
(8030, 1420, '_section_content_17_content', 'field_56d684eabc72d'),
(8031, 1420, 'section_content_18_image', '1455'),
(8032, 1420, '_section_content_18_image', 'field_56d684d7bc72b'),
(8033, 1420, 'section_content_18_heading', 'Gold Sponsor - Parkequip'),
(8034, 1420, '_section_content_18_heading', 'field_56d684e6bc72c'),
(8035, 1420, 'section_content_18_content', 'For one of the largest ranges of park equipment supplies, you need look no further than Parkequip.\r\n\r\nAt Parkequp we recognise that the purchase of items for your park, is a huge responsibility. Issues such as "Quality, Value and Safety" have to be considered. All materials used in the Parkequip range have been selected for their value, strength and durability to withstand heavy use and exposure.\r\n\r\nNo one offers more design expertise or product options and guidance, to bring your unique project to life, than your team from Parkequip.\r\n\r\nAre you ready to create a destination unlike any other? A design that leaves kids and parents begging for more?\r\n\r\nCheck out our website at <a href="http://www.parkequip.com.au">www.parkequip.com.au</a> or give our design team a call on (02) 9725 5604'),
(8036, 1420, '_section_content_18_content', 'field_56d684eabc72d'),
(8037, 1420, 'section_content_19_image', '1456'),
(8038, 1420, '_section_content_19_image', 'field_56d684d7bc72b'),
(8039, 1420, 'section_content_19_heading', 'Gold Sponsor - Sleepmaker Commercial'),
(8040, 1420, '_section_content_19_heading', 'field_56d684e6bc72c'),
(8041, 1420, 'section_content_19_content', 'SleepMaker is part of one of Australasia\'s largest bedding company\'s The Comfort Group, with 10 manufacturing sites and over 1200 employees across Australia and New Zealand, SleepMaker has a proud history that spans over 80 years.\r\n\r\nSleepMaker® Commercial Solutions has achieved the highest reputation for developing superior quality technologically advanced bedding solutions for a range of industries. The development of Continuous Coil Systems, Pocket Spring and technologies reflects our commitment to developing superior products.\r\n\r\nWith dedication and commitment, we listen to our customers and aim to develop products that match their requirements.\r\n\r\nOur Commercial Solution offers superior quality, competitive prices, durability and satisfaction underpinned by the industry\'s leading brands SleepMaker®, Seta ®, and Simmons®.\r\n\r\n<a href="http://www.sleepmaker.com.au/our-brands/Sleepmaker-Commercial.asp">http://www.sleepmaker.com.au/our-brands/Sleepmaker-Commercial.asp</a>'),
(8042, 1420, '_section_content_19_content', 'field_56d684eabc72d'),
(8043, 1420, 'section_content_20_image', '1457'),
(8044, 1420, '_section_content_20_image', 'field_56d684d7bc72b'),
(8045, 1420, 'section_content_20_heading', 'Gold Sponsor - Yarrawonga Manufactured Housing'),
(8046, 1420, '_section_content_20_heading', 'field_56d684e6bc72c'),
(8047, 1420, 'section_content_20_content', 'YMH is a family owned business who really cares and aims to offer the highest quality and finish to their homes, villas and commercial buildings.\r\n\r\nEach and every one is built to meet Australian standards and is an affordable solution to meet your requirements.\r\n\r\nWe are guided by our values of quality, great customer service, commitment and loyalty, no shortcuts and respect and hard work.\r\n\r\n<a href="http://www.yarrahousing.com.au/">http://www.yarrahousing.com.au/</a>'),
(8048, 1420, '_section_content_20_content', 'field_56d684eabc72d'),
