(8363, 1489, '_section_content_0_heading', 'field_56d684e6bc72c'),
(8364, 1489, 'section_content_0_content', 'VicParks would like to acknowledge our Legends. The VicParks Industry Legend Award is the highest honour that can be bestowed on a person involved in the caravan park industry in Victoria, and is awarded for a significant and altruistic contribution to the establishment and growth of the industry over a long period of time. Our Legends include:\r\n<ul>\r\n	<li>Don &amp; Judy Golightly</li>\r\n	<li>Phil &amp; Elizabeth Redmond</li>\r\n	<li>Jack Stephens</li>\r\n	<li>Des &amp; Margaret Watts</li>\r\n	<li>Norm &amp; Lavinia Wolfenden</li>\r\n	<li>John &amp; Janice Wynn</li>\r\n</ul>\r\n<strong>2012</strong>\r\n<ul>\r\n	<li>Bob Murray</li>\r\n	<li>Peter Crawford</li>\r\n	<li>Paul Milward-Bason &amp; Heather Scheuffele - Benji Distributors</li>\r\n</ul>\r\n<strong>2013</strong>\r\n<ul>\r\n	<li>Robert Ensink</li>\r\n</ul>\r\n<strong>2014</strong>\r\n<ul>\r\n	<li>Allan &amp; Audeen Walls</li>\r\n</ul>\r\n<strong>2015</strong>\r\n<ul>\r\n	<li>Ray &amp; Barbara Octigan</li>\r\n	<li>K-Mac Powerheads</li>\r\n</ul>'),
