(8385, 1490, 'section_content_0_content', 'VicParks would like to acknowledge our Life Members. VicParks Life Membership is bestowed upon a person involved in the caravan park industry in Victoria, and is awarded for a significant contribution to the establishment and growth of the industry over an extended period of time. Our Life Members include:\r\n\r\n1977 - George Young\r\n\r\n1978 - Ray Foley\r\n\r\n1980 - Harry Chester\r\n\r\n1982 - Frank Bond\r\n\r\n1985 - Roy &amp; Molly Finlayson\r\n\r\n1985 - Leslie Norman Ley\r\n\r\n1993 - David MacFarlane\r\n\r\n1993 - Greg Smith\r\n\r\n2000 - Frances von Kalm\r\n\r\n2003 - Phil Redmond\r\n\r\n2006 - Bob Farmer\r\n\r\n2008 - Ken Jenkin\r\n\r\n2011 - Kel Arnott\r\n\r\n2012 - Peter Corish'),
