(9519, 1652, 'page_excerpt', '<strong>Caretaker Position - Mildura</strong>\r\n\r\nWe currently have a vacancy for a full time position for a caretaker couple at our park located in Mildura.\r\n\r\nThe position is ideally available before Easter.\r\n\r\nThe couple will be working closely with both the Owner/Managers and the Assistant Managers in all areas of the park including:\r\n<ul>\r\n	<li>Maintenance</li>\r\n	<li>Reservations/Reception</li>\r\n	<li>and Housekeeping.</li>\r\n</ul>\r\nExperience preferred but not essential.\r\n\r\nIf you would like further information please contact us by email on business@goldenriverholidaypark.com.au\r\n\r\n<hr />\r\n\r\n<strong>Caravan Park Managers for Caravan Park in Western Victoria</strong>\r\n\r\nWe are looking for a couple who have experience to manage the day to day running of our medium sized caravan park in Western Victoria.\r\n\r\nExperience in caravan park/accommodation industry and be familiar with RMS booking.\r\n\r\nYour responsibilities would be:\r\n<ul>\r\n	<li>Cleaning and Housekeeping of the Cabins, Units, Amenities, Camp Kitchen, Bar-b-ques,</li>\r\n	<li>Pool &amp; Laundry Laundering of some linen and towels</li>\r\n	<li>Gardening &amp; Mowing</li>\r\n	<li>Pool Maintenance Repairs and Maintenance of Park as required</li>\r\n	<li>RMS reservation system with bookings</li>\r\n	<li>Managing the office phone calls, bookings, email\'s, tourist information, permanents, annual and day to day customers</li>\r\n</ul>\r\nThe position is 7-day week with 4-5 days off per month.\r\n\r\nAn ABN is required for this position.\r\n\r\nIncluded, if required a furnished 3-4-bedroom House with free Wifi, electricity and gas.\r\n\r\nWe also need you to be available to start this position by the 8th February or earlier.\r\n\r\nPlease forward current resume of experience to:\r\n\r\n<a href="http://caravanparkapplications@gmail.com">caravanparkapplications@gmail.com</a>\r\n\r\nor Ph: Mark or Sharon on 0419179202 or 0418371422\r\n\r\n<hr />\r\n\r\n<strong>Torquay Foreshore Caravan Park</strong>\r\n\r\n<strong>Assistant Park Manager/s</strong>\r\n\r\nThe Great Ocean Road Coast Committee (GORCC) is seeking an assistant park manager or assistant park manager couple for our Torquay Foreshore Caravan Park.\r\n\r\nThe position provides an opportunity to contribute as part of the management team to the operation and improvement of this important and popular Great Ocean Road region attraction and offers a competitive remuneration package, including on-site accommodation in Torquay.\r\n\r\nA Position Description and information about GORCC can be found at www.gorcc.com.au. Information about the park can be found at <a href="http://www.torquaycaravanpark.com.au/">www.torquaycaravanpark.com.au</a>.\r\n\r\nApplications close at 12:00 noon on Monday 21 December 2015.\r\n\r\nEnquiries may be directed to Simon Coverdale, Commercial Manager, on 5220 5055 or via email at simon.c@gorcc.com.au\r\n\r\n<hr />\r\n\r\n<strong>Support Community Manager/Caretaker - Benalla</strong>\r\n\r\nResidential Parks Gateway Lifestyle is an ASX Top 200 Companies listed with an established track record in the development and management of residential communities.\r\n\r\nOur aim is to consistently fulfil the lifestyle expectations of our residents by creating and maintaining sustainable, secure and vibrant communities. Our entire team is charged with delivering quality parks that represent value for money which create a vibrant lifestyle within a secure community of like-minded people.\r\n<ul>\r\n	<li>Location – Benalla</li>\r\n	<li>Full Time position About you: The ideal Gateway team members possess the following attributes and skills:</li>\r\n	<li>Hospitality management experience, preferably within community living and/or Tourism Parks;</li>\r\n	<li>Proven customer service and communication skills;</li>\r\n	<li>Experience using RMS property management system, or similar; Proven capability of multiple staff management;</li>\r\n	<li>Excellent administrative Demonstrated financial accounting controls and practices;</li>\r\n	<li>A commitment to developing and maintaining a vibrant community environment founded on mutual respect.</li>\r\n	<li>Maintenance and Grounds experience</li>\r\n</ul>\r\n<strong>About the role:</strong>\r\n\r\nWe have openings for a Support Community Manager/Caretaker, immediately available at our Benalla Victoria location with further opportunities in the pipeline throughout this financial year. As a Support Community Manager/Caretaker, the position is hands on and your primary responsibility will be to lead your team whilst ensuring there is a strong focus on customer satisfaction and generating revenue.\r\n\r\n<strong>Experience needed:</strong>\r\n<ul>\r\n	<li>Management of the operations, including permanent residences and tourist sites (location dependent);</li>\r\n	<li>Building and maintaining positive and lasting relationships with all stakeholders; Support for the sales and development teams;</li>\r\n	<li>Management of staff ensuring efficiency and productivity through rostering and performance;</li>\r\n	<li>Statutory and corporate compliance. Community liaison and support; Day to day office administration including reception, reservations, monitoring of accounts, and expense control;</li>\r\n	<li>Adherence to maintenance and grounds programs.</li>\r\n</ul>\r\nYou will have gained a comprehensive first-hand knowledge from your experience from working in hospitality and/or the Tourism Industry where you will have delivered exceptional service and measurable results.\r\n\r\nYou will also have experience managing employee performance and know exactly how to delegate work effectively.\r\n\r\n<strong>What\'s on offer:</strong>\r\n\r\nThe right candidates will be offered full time employment with a generous salary package including on site accommodation.\r\n\r\n<strong>HOW TO APPLY</strong>\r\n\r\nPlease send us your resume and a cover letter including current referees.\r\n\r\nFurther information may be obtained by contacting The Recruitment Officer Gateway Lifestyle at Michelle.Fisher@gatewaylifestyle.com.au\r\n\r\nPlease note that to be considered for this role you must be able to work in Australia and be residing in Australia at the time of application. *Only candidates through to the next round will be contacted.\r\n\r\nRecruitment agencies need not apply.\r\n\r\n<hr />\r\n\r\n<strong>Park Manager Workshop in November</strong>\r\n\r\nA 3 Day Workshop is being held 25 - 27 November 2015 at Traralgon Park Lane Holiday Park\r\n\r\nPlease find attached flyer below.\r\n\r\n<a href="http://vicparks.dev/app/uploads/2015/12/Park-Manager-Training-Flyer_1.pdf">Park Manager Trainig Flyer</a>\r\n\r\n<hr />\r\n\r\n<strong>Position Vacant - Lake Eppalock</strong>\r\n\r\nWe have a vacancy for Resident Managers (preferably a husband and wife team) at the Lakeshore Caravan Park situated on Lake Eppalock.\r\n<ul>\r\n	<li>Must have computer skills (MYOB, Excel and Word).</li>\r\n	<li>Sound knowledge of OH &amp; S, EPA and CFA requirements</li>\r\n	<li>Needs to be a handyman for maintenance, and a person who can see the big picture of running a 250 site park, of mostly annual residents.</li>\r\n</ul>\r\nThere is an assistant manager and casual staff on site to organise. Must be prepared to learn the full operation of the park\r\n\r\nA good 3 bdrm fully furnished residence and remuneration provided, sale of vans extra.\r\n\r\nA job description is available by contracting <a href="http://lakeshorecp@bigpond.com">lakeshorecp@bigpond.com</a>'),
