(2, 1, '2015-12-09 04:06:43', '2015-12-09 04:06:43', 'If you operate a caravan park or work in a related industry or are seeking employment within the caravan park industry and would like to join Vic Parks (Victorian Caravan Parks Association) and start enjoying the many benefits our membership offers, please complete your details below and we will contact you regarding membership.\r\n\r\nIf you are a Supplier and would like to register your company interest in our trade exhibition to be held at the Pullman Melbourne, 22-24 August 2016.\r\n\r\nPlease send through a request for further information on the form below', 'Why Join?', '', 'publish', 'closed', 'open', '', 'why-join', '', '', '2016-03-09 00:43:58', '2016-03-09 00:43:58', '', 0, 'http:http://vicparks.dev/?page_id=2', 0, 'page', '', 0),
