(514, 1, '2016-02-20 09:19:37', '2016-02-20 09:19:37', 'Riverglen Holiday Park is situated in a quiet shady park setting – only minutes from the stunning Geelong Waterfront, CBD, superb restaurants, shopping centres and markets. Skilled Stadium, home of the Geelong ‘Cats’ is within walking distance.\r\n\r\nA few minutes drive leads you to The Great Ocean Road, showcasing our world-class beaches. The Bellarine Peninsula and surrounding area offers great wineries, delightful cafes and award winning restaurants.\r\n\r\nThe park hosts a variety of accommodation ranging from the deluxe cedar spa cottages, deluxe cedar cabins to shady powered sites. All cabins have an ensuite, air-conditioning and are fully self-contained. The children will be occupied for hours with the playground, jumping pillow and the sparkling swimming pools. A modern conference room with kitchen facilities, a camp kitchen, games room, playground and five BBQ’s are all situated within the park.', 'Riverglen Holiday Park', '', 'publish', 'closed', 'closed', '', 'riverglen-holiday-park', '', '', '2016-02-20 09:19:37', '2016-02-20 09:19:37', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=514', 0, 'park', '', 0),
