(528, 1, '2016-02-20 09:49:33', '2016-02-20 09:49:33', 'A family friendly park with great facilities to keep the children entertained while the adults relax. Situated on the beautiful Bellarine Peninsula, the park is close to beaches, river and other great local attractions.\r\n\r\nAccommodation options include camping to fully self-contained cabins, sleeping up to two adults and six children. The township of Ocean Grove is only 1km away, where there are lots of places to eat and a variety of shops to browse.\r\n\r\nOcean Grove Holiday Park is a great place to stay a while, anytime of the year. “Fun Holidays, Fond Memories”.', 'Ocean Grove Holiday Park', '', 'publish', 'closed', 'closed', '', 'ocean-grove-holiday-park', '', '', '2016-02-20 09:49:33', '2016-02-20 09:49:33', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=528', 0, 'park', '', 0),
