(546, 1, '2016-02-20 10:22:19', '2016-02-20 10:22:19', 'Geelong’s most central tourist park on the banks of the Barwon River. Situated only minutes from the waterfront, CBD, restaurants, Skilled Stadium and the Great Ocean Road including Australia’s most popular surf beaches. Within walking distance to all your needs; supermarkets, cafes, bars, banks, restaurants, Geelong’s public swimming centre, bus stops and train stations.\r\n\r\nWhy not base your holiday in one of our wide variety of accommodation options from luxury air-conditioned cabins, modern ensuite sites, caravan sites and shady tent areas.\r\n\r\nWe have plenty to keep everyone entertained at our tourist park with our range of fantastic accommodation and great facilities, including jumping pillow, pedal go-karts, two playground areas, two BBQ areas, laundry, two amenities blocks, campers kitchen, wireless internet and kiosk.', 'Barwon River Tourist Park', '', 'publish', 'closed', 'closed', '', 'barwon-river-tourist-park', '', '', '2016-02-20 10:22:19', '2016-02-20 10:22:19', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=546', 0, 'park', '', 0),
