(589, 1, '2016-02-20 10:54:50', '2016-02-20 10:54:50', 'Geelong\'s premier caravan and tourist park providing a unique range of Tourist, Corporate and Residential Accommodation.\r\n\r\nWhere you can spoil yourself with the luxury of an entire ensuite park or choose from a fantastic range of self contained cabins and facilities including our Giant Jumping Pillow and Pedal Go-Karts. While staying at the Eldorado Tourist Park Geelong discover the spectacular wildness of the Great Ocean Road and Otway Ranges, or explore the Bellarine Bays and Peninsulas and heritage of the Goldfields.\r\n\r\nLess than an hour from Melbourne it\'s a great place for an ideal and affordable holiday for couples and families or that weekend away. Set on 10 acres you can relax and enjoy our quiet, friendly and secure environment in a spacious, tree lined setting.\r\n\r\nWe look forward to you visiting our Geelong caravan park and enjoying all that Eldorado Tourist Park Geelong has to offer.', 'El Dorado Tourist Park', '', 'publish', 'closed', 'closed', '', 'el-dorado-tourist-park', '', '', '2016-02-20 10:54:50', '2016-02-20 10:54:50', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=589', 0, 'park', '', 0),
