(599, 1, '2016-02-20 11:41:15', '2016-02-20 11:41:15', '2010 Victorian Tourism Award-Winning BIG4 Beacon Resort is a popular caravanning hot spot nestled at the entrance to Queenscliff on the Bellarine Peninsula, just 90km south-west of Melbourne.\r\n\r\nOur self-contained accommodation range includes luxury villas with contemporary decor, mod-cons throughout, even gas log fires whilst traditional cabins, units, motel rooms plus caravan and camping sites allow for a wide range of holiday styles and budgets.\r\n\r\nYour ideal launching pad for a short break or an extended holiday just 4km from the car ferry... enjoy a stroll to the beach, indulge in food and wine on the Taste Trail or experience the Bellarine’s many theme parks and attractions.\r\n\r\nAs the parks’ owners of 41 years, the Golightly family and their staff passionately share their local knowledge and provide a warm welcome all year round, with an expansive children’s activity program and indoor leisure facilities creating a one-stop holiday destination.', 'BIG4 Beacon Resort', '', 'publish', 'closed', 'closed', '', 'big4-beacon-resort', '', '', '2016-02-20 11:51:37', '2016-02-20 11:51:37', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=599', 0, 'park', '', 0),
