(624, 1, '2016-02-20 12:33:41', '2016-02-20 12:33:41', 'Nestled between Victoria\'s Surf Coast and the swimming beaches of Port Phillip Bay, Swan Bay Holiday Park sits on the shore of Swan Bay and is within a direct access to the boat ramp and jetty, ideal for the fishing enthusiast. The park boasts a fantastic collection of features for outdoor sports fanatics, presenting a pool, putting green, tennis court, basketball court and walking track.\r\n\r\nIf you dabble in wildlife adventures, just walk down to the Bay and you are standing in Port Phillip Heads National Marine Park. Jump on a boat or kayak whilst encircled by some of Australia\'s rarest species fo birds or submerge yourself and see it all froma different angle, scuba diving.\r\n\r\nSwan Bay is in easy reach of some excellent golf courses and cafes, celebrated swimming and surf beaches and the stunning Bellarine Peninsula wineries.\r\n\r\nSwan Bay is a gentle 75 minute drive from Melbourne and 90 minutes from Ballarat.', 'Swan Bay Holiday Park', '', 'publish', 'closed', 'closed', '', 'swan-bay-holiday-park', '', '', '2016-02-20 12:33:41', '2016-02-20 12:33:41', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=624', 0, 'park', '', 0),
