(640, 1, '2016-02-21 06:40:23', '2016-02-21 06:40:23', 'BIG4 Whiters Holiday Village is situated on five acres of beautifully landscaped gardens with resort-style accommodation and facilities. We have a great range of activities and facilities for the kids which will ensure a wonderful family holiday.  With six styles of cabin accommodation and 2 ensuite caravan sites, we’re sure to have something to suit your needs!\r\n\r\nWe are situated two blocks from the main shopping centre and the footbridge that leads to the famous 90-mile beach, which is excellent for windsurfing and swimming.  Across the road is a great Putt-Putt mini-golf course. We pride ourselves on a high standard of cleanliness, and in helping our guests enjoy their stay. ', 'BIG4 Whiters Holiday Village', '', 'publish', 'closed', 'closed', '', 'big4-whiters-holiday-village', '', '', '2016-02-21 06:40:23', '2016-02-21 06:40:23', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=640', 0, 'park', '', 0),
