(658, 1, '2016-02-21 07:01:00', '2016-02-21 07:01:00', 'Our park is located on a hillside overlooking beautiful Wilson’s Prom and Corner Inlet. It is surrounded by the rolling hills of the Strzelecki Ranges and situated at the foot of the Toora Wind Farm.\r\n\r\nSupermarket, cafes and shops are all walking distance of the park and it is only a short drive to The Prom, Agnes Falls, Tarra Bulga National Park, Sandy Point, Waratah Bay, Walkerville, Port Albert, Port Franklin, Port Welshpool and much, much more.\r\n\r\nFacilities include heated indoor pool and spa (all year), jumping pillow, trampoline, playgrounds, tennis court, beach volleyball, recreation room and camp kitchen. The newly refurbished amenities block including toilets, showers and laundry are spacious, bright and clean. We have ensuite sites, powered sites, budget and luxury cabins.\r\n\r\nToora Tourist Park is an ideal spot to stay whilst exploring the many attractions South Gippsland has to offer.', 'Toora Tourist Park', '', 'publish', 'closed', 'closed', '', 'toora-tourist-park', '', '', '2016-02-21 07:01:00', '2016-02-21 07:01:00', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=658', 0, 'park', '', 0),
