(678, 1, '2016-02-21 13:30:57', '2016-02-21 13:30:57', 'Stratford on the River Tourist Park is a small, peaceful, family run Top Tourist park, located 3 hours from Melbourne with Gippsland Lakes, High Country, and Ninety Mile Beach nearby.\r\n\r\nThe Perrett family welcome all visitors to their award winning park sited on the banks of the Avon River. The Park is only a short stroll from the centre of town and offers a range of pet-friendly accommodation to suit all budgets, including large shaded sites (some drive through), and budget through to superior 2 bedroom cabins surrounded by 4 acres of park like grounds overlooking the River.\r\n\r\nVisitors may also access the adjoining council swimming pool when open. The facilities are immaculately clean and include a well appointed camp kitchen, laundry and undercover barbecue and eating area together with a number of open fireplaces that make wonderful meeting areas and a small children’s playground is close at hand.', 'Stratford on the River Tourist Park', '', 'publish', 'closed', 'closed', '', 'stratford-on-the-river-tourist-park', '', '', '2016-02-21 13:30:57', '2016-02-21 13:30:57', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=678', 0, 'park', '', 0),
