(689, 1, '2016-02-21 13:50:53', '2016-02-21 13:50:53', 'We are a small family friendly park located within a 5 minute walk to the footbridge over to 90 mile beach. We have a range of accommodation from powered sites to a 4 bedroom self-contained house that sleeps 10 people.\r\n\r\nWe are within 5 minutes walk to shops and restaurants but far enough away that we are very quiet and private.\r\n\r\nWe have a small enclosed playground, solar heated swimming pool, games room, camp kitchen, fish cleaning area, laundry facilities and spa.\r\n\r\nBoat and caravan parking is available. All sites and cabins have a car park for one car. We are a pet friendly park for sites and have some pet friendly cabins available upon request.', 'Echo Beach Tourist Park', '', 'publish', 'closed', 'closed', '', 'echo-beach-tourist-park', '', '', '2016-02-21 13:50:53', '2016-02-21 13:50:53', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=689', 0, 'park', '', 0),
