(720, 1, '2016-02-21 14:32:21', '2016-02-21 14:32:21', 'BIG4 Inverloch Holiday Park is superbly situated on Anderson Inlet, close to nearby attractions of Phillip Island and Wilson\'s Promontory, and around 90 minutes drive from Melbourne, Victoria.\r\n\r\nBIG4 Inverloch Holiday Park is a resort style park with a complete range of accommodation, caravan sites and recreational facilities including an indoor heated pool. BIG4 Inverloch is an ideal base to explore the Bass Coast.\r\n\r\nRelax on the deck of our Luxury Villas or get great value for your holiday dollar in our range of self-contained cabin accommodation. Travellers in caravans and motorhomes will love our ensuite sites with your own private bathroom. Enjoy the indoor heated pool, BBQs and kids playgrounds.\r\n\r\nThe Edwards family have been working together operating Holiday Parks for the past 16 years. Their dedication to ensuring their guests have a relaxing and enjoyable holiday is reflected in the park\'s laid back atmosphere and in the fun and friendly staff that work with them.', 'BIG4 Inverloch Holiday Park', '', 'publish', 'closed', 'closed', '', 'big4-inverloch-holiday-park', '', '', '2016-03-05 03:08:07', '2016-03-05 03:08:07', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=720', 0, 'park', '', 0),
