(776, 1, '2016-02-22 07:30:35', '0000-00-00 00:00:00', 'Family friendly with large pool, playground and games room.\r\n\r\nAn easy stroll to the superb 90 Mile Beach, and close to shops, restaurants and many well-known local attractions in and around Lakes Entrance.', 'Koonwarra Family Holiday Park', '', 'draft', 'closed', 'closed', '', 'koonwarra-family-holiday-park', '', '', '2016-02-22 07:30:35', '2016-02-22 07:30:35', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=776', 0, 'park', '', 0),
(777, 1, '2016-02-22 09:22:17', '0000-00-00 00:00:00', 'The Cape Paterson Camping and Caravan Park is situated along the foreshore reserve at Cape Paterson. It is planned out to take advantage of the natural setting and proximity to the beaches. We have a wide variety of van or tent sites and self-contained on suite cabins, most set amongst the tea-tree and being a short stroll from the beaches, rock pools and dunes.\r\n\r\nFor fishing, surfing, swimming, walking or just relaxing in beautiful surroundings - it doesn’t get much better than this!\r\n\r\nWe’re proud of our family-oriented park and think that it’s the perfect place to get away for a quiet, relaxing holiday.\r\n\r\nGIFT VOUCHERS are available for cabin accommodation - give your family or friends a gift by purchasing a voucher for accommodation in one of our three types of cabins.', 'Cape Paterson Caravan Park', '', 'draft', 'closed', 'closed', '', 'cape-paterson-caravan-park', '', '', '2016-02-22 09:22:17', '2016-02-22 09:22:17', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=777', 0, 'park', '', 0),
(778, 1, '2016-02-22 09:21:35', '2016-02-22 09:21:35', '', 'logo', '', 'inherit', 'open', 'closed', '', 'logo-11', '', '', '2016-02-22 09:21:35', '2016-02-22 09:21:35', '', 777, 'http://vicparks.dev/app/uploads/2016/02/logo-7.jpg', 0, 'attachment', 'image/jpeg', 0),
(779, 1, '2016-02-22 09:26:44', '0000-00-00 00:00:00', 'Swan Reach Holiday park is an award-winning property located in the Gippsland region, South-East Victoria. Surrounded by luscious landscape, the Tambo River meanders through Swan Reach.\r\n\r\nImmerse yourself into pure nature by enjoying the splendour of the Gippsland Lakes, the spectacle of the wetlands and its birdlife or it you\'re feeling adventurous, the Buchan Caves are waiting to be explored.\r\n\r\nOur resort is perfect for relaxing in our immaculate six hectare gardens, unwinding by the pool, or enjoying a spot of fishing or boating on the Tambo. Otherwise, adventure furtherfield, check out the nine nearby National Parks. Enjoy a sunset stroll down to the sea front and buy scallops and prawns directly from the fishing boat to BBQ for dinner.\r\n\r\nWith a selection of different types of accommodation and an array of local attractions on offer, it will be hard to leave us. Our park offers different types of accommodation to cater for all your needs.', 'Swan Reach Holiday Park', '', 'draft', 'closed', 'closed', '', 'swan-reach-holiday-park', '', '', '2016-02-22 09:26:44', '2016-02-22 09:26:44', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=779', 0, 'park', '', 0),
(780, 1, '2016-02-22 09:41:45', '0000-00-00 00:00:00', 'Waratah Bay Caravan Park is superbly located alongside one of Victoria’s most beautiful beaches. It boasts 20km of pristine, unspoilt sandy beach.\r\n\r\nSome of our Park cabins have the best views across the bay to Wilson’s Promontory. One of Victoria\'s most beautiful beaches safe for swimming, surfers, day walkers and dog friendly (restrictions apply).\r\n\r\nFor the fishing enthusiast there is plenty of open surf fishing, sand launch a boat, or boat ramp within 20 minutes drive. For the keen bushwalker there is ample areas though the Cape Liptrap coastal park for loads of walking.', 'Waratah Bay Caravan Park', '', 'draft', 'closed', 'closed', '', 'waratah-bay-caravan-park', '', '', '2016-02-22 09:41:45', '2016-02-22 09:41:45', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=780', 0, 'park', '', 0),
(781, 1, '2016-02-22 09:41:10', '2016-02-22 09:41:10', '', 'waratah-bay-caravan-park-logo', '', 'inherit', 'open', 'closed', '', 'waratah-bay-caravan-park-logo', '', '', '2016-02-22 09:41:10', '2016-02-22 09:41:10', '', 780, 'http://vicparks.dev/app/uploads/2016/02/waratah-bay-caravan-park-logo.jpg', 0, 'attachment', 'image/jpeg', 0),
(782, 1, '2016-02-22 10:06:36', '0000-00-00 00:00:00', 'The Eureka Stockade Holiday Park is only five minutes from the centre of Ballarat, located directly alongside the Eureka Stockade monument and reserve, which boasts a brand new adventure playground for the children to enjoy.\r\n\r\nThe Eureka Centre and the new Tourist Information Centre are metres away and close by are many of Ballarat\'s diverse attractions including Sovereign Hill within two kilometres and the Ballarat Wildlife Park only a ten minute walk.\r\n\r\nYour hosts, Graeme, Loyola & Luke McKenzie and Brooke Wilkins ensure five star customer service offering an extensive range of accommodation options and facilities as well as helpful, local knowledge on Ballarat and surrounding districts including hospitality, shopping precincts, entertainment and tourist attractions.', 'Eureka Stockade Holiday Park', '', 'draft', 'closed', 'closed', '', 'eureka-stockade-holiday-park', '', '', '2016-02-22 10:06:36', '2016-02-22 10:06:36', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=782', 0, 'park', '', 0),
(783, 1, '2016-02-22 09:47:38', '2016-02-22 09:47:38', '', 'logo', '', 'inherit', 'open', 'closed', '', 'logo-12', '', '', '2016-02-22 09:47:38', '2016-02-22 09:47:38', '', 782, 'http://vicparks.dev/app/uploads/2016/02/logo-3.png', 0, 'attachment', 'image/png', 0),
(784, 1, '2016-02-22 10:06:43', '0000-00-00 00:00:00', 'Whether you’re a family looking for a fun-filled holiday destination, a couple who love the freedom of caravanning, or an adventure traveller chasing a touch of luxury, you’ll love what BIG4 Ballarat Goldfields Holiday Park has to offer. Camp in comfort is our motto and we have a range of facilities to ensure your stay at our boutique caravan and camping park is second to none.\r\n\r\nWe have built our reputation on providing a complete holiday experience that is truly memorable… a fun, friendly, relaxed and welcoming atmosphere with a choice of accommodation from luxury spa villas to budget cabins and ensuite, caravan and camping sites.', 'BIG4 Ballarat Goldfields Holiday Park', '', 'draft', 'closed', 'closed', '', 'big4-ballarat-goldfields-holiday-park', '', '', '2016-02-22 10:06:43', '2016-02-22 10:06:43', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=784', 0, 'park', '', 0),
(785, 1, '2016-02-22 09:53:46', '2016-02-22 09:53:46', '', 'logo', '', 'inherit', 'open', 'closed', '', 'logo-13', '', '', '2016-02-22 09:53:46', '2016-02-22 09:53:46', '', 784, 'http://vicparks.dev/app/uploads/2016/02/logo-8.jpg', 0, 'attachment', 'image/jpeg', 0),
(786, 1, '2016-02-22 10:06:54', '0000-00-00 00:00:00', 'Set amongst 9 acres of landscaping and trees on the banks of Lake Victoria, our caravan park is a tranquil and spacious haven designed for a relaxing holiday or a pleasant short stay.  A 5 minute stroll around the lake will see you in the heart of the town centre, with all major shops, restaurants, swimming pool, tennis courts, children\'s playground and golf course close by.\r\n\r\nMaryborough is in the heart of the Victorian Goldfields, making the Maryborough Caravan Park the ideal base to discover not only gold but also the spectacular sites of our box-ironbark forest with it\'s wildflowers, birds and superb display of Wattle in springtime.  You can visit nearby wineries, or spend time exploring the local markets and galleries, or just indulge in fine wine and dining.  A little less than 2 hours from Melbourne it\'s a great place for an ideal and affordable holiday for couples and families or that weekend away.\r\n\r\nThe caravan park accommodation includes 1 and 2 bedroom cottages, cabins, powered sites, catering for caravans and the largest motorhomes, and unpowered sites. Our cottages and cabins have ensuites and are fully self-contained and have air conditioning and heating. Bedding, linen and towels are provided on the main bed, mattress protectors and fitted sheets are provided on the single bunks at not extra cost.\r\n\r\nWe are a pet friendly caravan park, with well behaved pets most welcome.', 'Maryborough Caravan Park', '', 'draft', 'closed', 'closed', '', 'maryborough-caravan-park', '', '', '2016-02-22 10:06:54', '2016-02-22 10:06:54', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=786', 0, 'park', '', 0),
(787, 1, '2016-02-22 09:58:29', '2016-02-22 09:58:29', '', 'logo', '', 'inherit', 'open', 'closed', '', 'logo-14', '', '', '2016-02-22 09:58:29', '2016-02-22 09:58:29', '', 786, 'http://vicparks.dev/app/uploads/2016/02/logo-9.jpg', 0, 'attachment', 'image/jpeg', 0),
(788, 1, '2016-02-22 10:07:03', '0000-00-00 00:00:00', 'Located on the Ballarat Avenue of Honour, BIG4 Ballarat Windmill Holiday Park is surrounded by trees and away from suburbia. Relax in our tranquil atmosphere, just minutes from the beautiful Lake and Gardens Precinct and the Heart of Historic Ballarat.\r\n\r\nAt BIG4 Ballarat Windmill Holiday Park and Caravan Park your leisure is the main priority of our entire team. Together we provide you with all the quality accommodation and recreation facilities you expect of a Victorian Tourism Award Winning holiday park.\r\n\r\nThe holiday park\'s location is only a short drive from popular attractions such as Sovereign Hill, Blood on the Southern Cross, The Eureka Centre and Lake Wendouree.', 'BIG4 Ballarat Windmill Holiday Park', '', 'draft', 'closed', 'closed', '', 'big4-ballarat-windmill-holiday-park', '', '', '2016-02-22 10:07:03', '2016-02-22 10:07:03', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=788', 0, 'park', '', 0),
(789, 1, '2016-02-22 10:04:57', '2016-02-22 10:04:57', '', 'BIG4-Ballarat-logo', '', 'inherit', 'open', 'closed', '', 'big4-ballarat-logo', '', '', '2016-02-22 10:04:57', '2016-02-22 10:04:57', '', 788, 'http://vicparks.dev/app/uploads/2016/02/BIG4-Ballarat-logo.png', 0, 'attachment', 'image/png', 0),
(790, 1, '2016-02-22 10:11:33', '0000-00-00 00:00:00', 'An outstanding, award winning park. Peaceful, quiet, modern, off highway location, approximately 5 minutes by car from the centre of Bendigo and the major attractions.\r\n\r\nNewly renovated amenities block (heated shower floors), new function/recreation room, new modern cabins (open plan, 1, 2, and 3 bedroom) complimented by a range of additional facilities, combined with excellent service, make our park your home away from home for your stay in Bendigo.', 'BIG4 Bendigo Ascot Holiday Park', '', 'draft', 'closed', 'closed', '', 'big4-bendigo-ascot-holiday-park', '', '', '2016-02-22 10:11:33', '2016-02-22 10:11:33', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=790', 0, 'park', '', 0),
(791, 1, '2016-02-22 10:16:23', '0000-00-00 00:00:00', 'Laanecoorie Lakeside Park is located on the shores of the lake in a natural bush setting. The Loddon River is also only a short walk away.\r\n\r\nEnjoy relaxation and tranquillity amongst the gum trees whilst sitting around your campfire. Activities include swimming, water skiing, fishing, gold prospecting, bushwalking and cycling.', 'Laanecoorie Lakeside Park', '', 'draft', 'closed', 'closed', '', 'laanecoorie-lakeside-park', '', '', '2016-02-22 10:16:23', '2016-02-22 10:16:23', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=791', 0, 'park', '', 0),
(792, 1, '2016-02-22 10:15:49', '2016-02-22 10:15:49', '', 'image', '', 'inherit', 'open', 'closed', '', 'image', '', '', '2016-02-22 10:15:49', '2016-02-22 10:15:49', '', 791, 'http://vicparks.dev/app/uploads/2016/02/image.jpg', 0, 'attachment', 'image/jpeg', 0),
(793, 1, '2016-02-22 10:20:52', '0000-00-00 00:00:00', 'A peaceful family park with sheltered, grassy sites and self-contained luxury and budget cabins. River and surf beach frontage, boat ramp (river), tennis courts, playground, BBQs, recreation room and camp kitchen. 10 minutes from Portland. Camp on the rivers edge with lovely views of the river and surrounds.\r\n\r\nThe Portland Region boasts many tourist attractions, all only a short drive from Narrawong Holiday Park.', 'Narrawong Holiday Park', '', 'draft', 'closed', 'closed', '', 'narrawong-holiday-park', '', '', '2016-02-22 10:20:52', '2016-02-22 10:20:52', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=793', 0, 'park', '', 0),
(794, 1, '2016-02-22 10:20:36', '2016-02-22 10:20:36', '', 'logo', '', 'inherit', 'open', 'closed', '', 'logo-15', '', '', '2016-02-22 10:20:36', '2016-02-22 10:20:36', '', 793, 'http://vicparks.dev/app/uploads/2016/02/logo-10.jpg', 0, 'attachment', 'image/jpeg', 0),
(795, 1, '2016-02-22 10:26:50', '0000-00-00 00:00:00', 'Aireys Inlet Holiday Park is a family friendly boutique park sited amongst art sculptures, trees and birdlife. Easy walking distance to sensational beaches, restaurants, art gallery, shops and a cosy pub. A spectacular cliff top walk of 30 minutes will take you to the renowned Split Point Lighthouse, well known for the children\'s ABC TV series “Round the Twist”.\r\n\r\nFully self-contained one and two bedroom cabins are available – budget to luxury. For the caravanner we have ensuited powered sites and powered sites. For the budget minded with a tent, unpowered sites are also available. We are pet friendly on ensuited powered sites and powered sites only. NOT available during Peak Periods.\r\n\r\nThe Parks facilities for guests are free BBQs, laundry facilities, solar heated swimming pool, heated spa, NEW campers kitchen, TV lounge room, children\'s playground, family bathroom, free wireless internet.\r\n\r\nCome, enjoy surfing, canoeing, rock pool rambling, fishing, bushwalking, bird watching, mountain biking, horse riding or tennis.', 'Aireys Inlet Holiday Park', '', 'draft', 'closed', 'closed', '', 'aireys-inlet-holiday-park', '', '', '2016-02-22 10:26:50', '2016-02-22 10:26:50', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=795', 0, 'park', '', 0),
(796, 1, '2016-02-22 10:26:25', '2016-02-22 10:26:25', '', 'logo', '', 'inherit', 'open', 'closed', '', 'logo-16', '', '', '2016-02-22 10:26:25', '2016-02-22 10:26:25', '', 795, 'http://vicparks.dev/app/uploads/2016/02/logo-11.jpg', 0, 'attachment', 'image/jpeg', 0),
(797, 1, '2016-02-22 10:31:29', '0000-00-00 00:00:00', 'Warrnambool Holiday Park is the only park in town with a brand new JUMPING PILLOW... So relax and unwind around our sparkling pool, play a game of billiards in our large games room, or burn up some energy by jumping on our Brand New Jumping Pillow, plus a playground to keep all ages busy, there is no need to leave our park.\r\n\r\nOur family friendly park is centrally located to local shops, the Hopkins River and a dog friendly beach. We offer shady grassed sites, self-contained cabins and apartments. Relax and unwind by our solar heated pool or use our park as a base to explore our rugged shipwrecked coast. Visit Tower Hill – our inactive volcano, walk along the promenade and take in the views of the coast line, do some fishing in the Hopkins River or watch the whales (June – Sept). You can watch the Laser show run by Flagstaff Hill nightly and then wander the village during the day, the kids can learn to surf or ride a horse along the beach, there is plenty to fill your days…', 'Warrnambool Holiday Park', '', 'draft', 'closed', 'closed', '', 'warrnambool-holiday-park', '', '', '2016-02-22 10:31:29', '2016-02-22 10:31:29', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=797', 0, 'park', '', 0),
(798, 1, '2016-02-22 10:30:59', '2016-02-22 10:30:59', '', 'WHP-Logo1', '', 'inherit', 'open', 'closed', '', 'whp-logo1', '', '', '2016-02-22 10:30:59', '2016-02-22 10:30:59', '', 797, 'http://vicparks.dev/app/uploads/2016/02/WHP-Logo1.png', 0, 'attachment', 'image/png', 0),
(799, 1, '2016-02-22 10:37:07', '0000-00-00 00:00:00', 'Some of the most breathtaking tourist spots in South Eastern Australia can be found along The Great Ocean Road. Adjacent to the beach, Discovery Holiday Parks – Warrnambool is the perfect home away from home to explore this picturesque coastline.\r\n\r\nIt’s also a family favourite, with park facilities including on-site playground, pedal karts, games room and swimming pool with spa. Our caravan park is also within walking distance of popular Lake Pertobe Adventure Park, one hour from the 12 Apostles and in easy reach of Port Fairy and the bustling township of Warrnambool.\r\n\r\nWhen you’re ready to rest your weary selves from a days sightseeing, it will be a joy to come home to our extensive range of comfortable accommodation, from a 4.5 star luxury spa cabin, to self-contained cabins and villas and fully equiped camping and caravan sites. Discovery Holiday Parks – Warrnambool is your home away from home.', 'Discovery Holiday Parks - Warrnambool', '', 'draft', 'closed', 'closed', '', 'discovery-holiday-parks-warrnambool', '', '', '2016-02-22 10:37:07', '2016-02-22 10:37:07', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=799', 0, 'park', '', 0),
(800, 1, '2016-02-22 10:36:31', '2016-02-22 10:36:31', '', 'logo_dhp', '', 'inherit', 'open', 'closed', '', 'logo_dhp', '', '', '2016-02-22 10:36:31', '2016-02-22 10:36:31', '', 799, 'http://vicparks.dev/app/uploads/2016/02/logo_dhp.png', 0, 'attachment', 'image/png', 0),
(801, 1, '2016-02-22 10:41:52', '0000-00-00 00:00:00', 'Geelong Surfcoast Highway Holiday Park offers a choice of motel units, deluxe cabins and ensuite powered sites. The park has a shaded baby pool, a swimming pool and an outdoor spa. There is a camp kitchen, a BBQ area, a bright colourful playground and a games and TV room.\r\n\r\nThe park is picturesque and is located only minutes from the start of the Great Ocean Road, ten minutes from the Geelong CBD and just minutes from the world renowned beaches of Torquay.\r\n\r\nThe beachfront town of Torquay is located 22 kilometres south of Geelong and at the northern end of the Surfcoast section of the Great Ocean Road.\r\n\r\nHosts: The Stanton Family', 'Geelong Surfcoast Hwy Holiday Park', '', 'draft', 'closed', 'closed', '', 'geelong-surfcoast-hwy-holiday-park', '', '', '2016-02-22 10:41:52', '2016-02-22 10:41:52', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=801', 0, 'park', '', 0),
(802, 1, '2016-02-22 10:41:28', '2016-02-22 10:41:28', '', 'logo', '', 'inherit', 'open', 'closed', '', 'logo-17', '', '', '2016-02-22 10:41:28', '2016-02-22 10:41:28', '', 801, 'http://vicparks.dev/app/uploads/2016/02/logo-4.png', 0, 'attachment', 'image/png', 0),
(803, 1, '2016-02-22 10:47:11', '0000-00-00 00:00:00', 'Torquay Holiday Park is located on the iconic Great Ocean Road, set in a picturesque landscape of gardens and trees, and located within walking distance to most beaches in the Torquay area. We are surrounded by a vast array of shops, restaurants and a host of recreation facilities.\r\n\r\nWe offer spotless amenities, shady powered caravan and camping sites, and a wide range of self contained cabin accommodation, along with family friendly facilities such as a swimming pool, jumping pillow, kids playground, mini golf, tennis & volleyball courts, games room, camp kitchen, outdoor movie screen, and seasonal kids activities. \r\n\r\nOur Torquay caravan park is the perfect place to just sit back and relax, or to use as a base to explore all that Torquay and the Surf Coast region has to offer.', 'Torquay Holiday Park', '', 'draft', 'closed', 'closed', '', 'torquay-holiday-park', '', '', '2016-02-22 10:47:11', '2016-02-22 10:47:11', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=803', 0, 'park', '', 0),
(804, 1, '2016-02-22 10:46:21', '2016-02-22 10:46:21', '', 'logo', '', 'inherit', 'open', 'closed', '', 'logo-18', '', '', '2016-02-22 10:46:21', '2016-02-22 10:46:21', '', 803, 'http://vicparks.dev/app/uploads/2016/02/logo-5.png', 0, 'attachment', 'image/png', 0),
(805, 1, '2016-02-22 11:02:28', '0000-00-00 00:00:00', 'Welcome to Portland Holiday Village, the most centrally located Caravan Park in the heart of Portland. Portland Holiday Village offers a variety of accommodation to suit all styles and budgets, ranging from fully self-contained villas to caravan and camping facilities.\r\n\r\nPortland Holiday Village is within easy walking distance to many of the town\'s services and attractions, including the foreshore, Nuns Beach, tram car, supermarket, shops, restaurants, clubs and bars. Portland Holiday Village is locally owned and operated offering quality accommodation and friendly service. Come in, park your car and leave it there! Everything is at your doorstep when you stay with us.', 'Portland Holiday Village', '', 'draft', 'closed', 'closed', '', 'portland-holiday-village', '', '', '2016-02-22 11:02:28', '2016-02-22 11:02:28', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=805', 0, 'park', '', 0),
(806, 1, '2016-02-22 10:51:06', '2016-02-22 10:51:06', '', 'Holiday-Village-logo-300x141', '', 'inherit', 'open', 'closed', '', 'holiday-village-logo-300x141-2', '', '', '2016-02-22 10:51:06', '2016-02-22 10:51:06', '', 805, 'http://vicparks.dev/app/uploads/2016/02/Holiday-Village-logo-300x141-1.png', 0, 'attachment', 'image/png', 0),
(807, 1, '2016-02-22 11:08:28', '0000-00-00 00:00:00', 'Portland Tourist Park is set on 11 acres of natural bushland, only 1.7 kilometres from the heart of historic Portland. During your visit you are sure to experience an abundance of native birds and wildlife - you may even sight one of the Koalas that frequent the Park.\r\n\r\nPortland Tourist Park offers a variety of accommodation to suit all styles and budgets, ranging from camping to ensuite sites to fully self-contained cabins. We have recently added two superior cabins to our Park.\r\n\r\nThe caravan park is ideal for fishermen with their own boats. Apart from having a boat wash and a large camp kitchen, the park also has ample room beside each site for boats to be conveniently parked within the owners view. A limited number of annual sites are also available.', 'Portland Tourist Park', '', 'draft', 'closed', 'closed', '', '', '', '', '2016-02-22 11:08:28', '2016-02-22 11:08:28', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=807', 0, 'park', '', 0),
(808, 1, '2016-02-22 11:00:49', '0000-00-00 00:00:00', 'Welcome to Warrnambool Holiday Village, a peaceful and immaculately maintained park situated in Warrnambool’s city centre. Recently redeveloped, Warrnambool Holiday Village now offers a range of accommodation from our BRAND NEW one bedroom deluxe cabins to our luxurious two bedroom superior and deluxe cabins to caravan and camping.\r\n\r\nWarrnambool Holiday Village is within easy walking distance of a supermarket complex (opposite), food outlets, newsagency, restaurants and just a few blocks from Warrnambool’s beautiful Botanical Gardens and fantastic indoor and outdoor swimming pools.', 'Warrnambool Holiday Village', '', 'draft', 'closed', 'closed', '', 'warrnambool-holiday-village', '', '', '2016-02-22 11:00:49', '2016-02-22 11:00:49', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=808', 0, 'park', '', 0),
(809, 1, '2016-02-22 11:00:07', '2016-02-22 11:00:07', '', 'Holiday-Village_Warrnambool-300x141', '', 'inherit', 'open', 'closed', '', 'holiday-village_warrnambool-300x141', '', '', '2016-02-22 11:00:07', '2016-02-22 11:00:07', '', 808, 'http://vicparks.dev/app/uploads/2016/02/Holiday-Village_Warrnambool-300x141.png', 0, 'attachment', 'image/png', 0) ;
