(812, 1, '2016-02-22 11:18:33', '0000-00-00 00:00:00', 'We are the largest caravan park located along the Great Ocean Road. On 16 hectares of picturesque native parkland bordered by the Anglesea River and Bass Strait, and only 70 minutes from Melbourne, it’s the perfect location to explore the Great Ocean Road, the Otways and all the beauty and adventure the Surf Coast offers.\r\n\r\nThe township of Anglesea, tennis courts and bowls club are only a five minute walk away. Because we have so much space we are able to offer you a huge range of camping and accommodation options – choose from treed bush camping or drive-thru sites, large grassed sites or group camping areas - all powered and some only 50 metres from the water! Accommodation options include basic through to luxury family, couples, spa, disabled and three bedroom cottages – all with ensuites and linen provided.\r\n\r\nOur outstanding facilities include mini-golf, giant jumping pillow and in-ground pool. Come stay and play!', 'Anglesea Beachfront Family Caravan Park', '', 'draft', 'closed', 'closed', '', 'anglesea-beachfront-family-caravan-park', '', '', '2016-02-22 11:18:33', '2016-02-22 11:18:33', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=812', 0, 'park', '', 0),
(813, 1, '2016-02-22 11:17:31', '2016-02-22 11:17:31', '', 'anglesea-beachfront-header', '', 'inherit', 'open', 'closed', '', 'anglesea-beachfront-header', '', '', '2016-02-22 11:17:31', '2016-02-22 11:17:31', '', 812, 'http://vicparks.dev/app/uploads/2016/02/anglesea-beachfront-header.jpg', 0, 'attachment', 'image/jpeg', 0),
(814, 1, '2016-02-22 11:23:14', '0000-00-00 00:00:00', 'The Big 4 Hopkins River Holiday Park caters for the whole family and is situated on 15 acres, 2 minutes walk from the Beautiful Hopkins River. We are 4.5 stars and offer a variety of accommodation options, ranging from 1 bedroom Villas to 3 bedroom, 2 bathroom Deluxe Family Villas. Our grassed powered and ensuites sites vary in size, are Motor Home friendly, and some drive thru sites available situated around well manicured gardens. \r\n\r\nYou can relax around the indoor heated pool and spa, enjoy a game of tennis or mini golf or just relax and watch the kids at the playground. For those with fitness in mind, try our fully equipped gym. Disabled toilet & showers facilities and laundry, also a kiosk and gas bottle exchange.', 'Hopkins River Caravan Park', '', 'draft', 'closed', 'closed', '', 'hopkins-river-caravan-park', '', '', '2016-02-22 11:23:14', '2016-02-22 11:23:14', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=814', 0, 'park', '', 0),
(815, 1, '2016-02-22 11:22:30', '2016-02-22 11:22:30', '', 'hrp_logo1', '', 'inherit', 'open', 'closed', '', 'hrp_logo1', '', '', '2016-02-22 11:22:30', '2016-02-22 11:22:30', '', 814, 'http://vicparks.dev/app/uploads/2016/02/hrp_logo1.png', 0, 'attachment', 'image/png', 0),
(816, 1, '2016-02-22 11:27:43', '0000-00-00 00:00:00', 'Cumberland River Holiday Park is a scenic family friendly camping ground with great facilities around 10 minutes or 7km southwest of Lorne on the famous Great Ocean Road.\r\n\r\nSituated on the banks of Cumberland River, the park offers riverside campsites, African Safari Tents as well as deluxe and standard cabins nestled in a lush green valley between majestic cliffs and mountains. The Park is a perfect base from which to explore the Great Ocean Road and surrounds.\r\n\r\nCumberland River Holiday Park allows guests to have your own campfire! Each campsite, cabin and safari tent comes with a half barrel drum that you can use as a campfire or BBQ.\r\n\r\nGo bushwalking, snorkel, try your luck fishing for trout, surf, swim or fish at our private beach only a stones throw away... Perhaps a walk along the coast ?\r\n\r\nWe don’t exaggerate when we say that Cumberland River Holiday Park is simply…PARADISE.', 'Cumberland River Holiday Park', '', 'draft', 'closed', 'closed', '', 'cumberland-river-holiday-park', '', '', '2016-02-22 11:27:43', '2016-02-22 11:27:43', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=816', 0, 'park', '', 0),
(817, 1, '2016-02-22 11:27:16', '2016-02-22 11:27:16', '', 'Logo1', '', 'inherit', 'open', 'closed', '', 'logo1', '', '', '2016-02-22 11:27:16', '2016-02-22 11:27:16', '', 816, 'http://vicparks.dev/app/uploads/2016/02/Logo1.png', 0, 'attachment', 'image/png', 0),
(818, 1, '2016-02-22 12:21:02', '0000-00-00 00:00:00', 'Located on the picturesque Torquay Foreshore, the Torquay Caravan Park is the perfect spot for a weekend away, a long vacation or an overnight camp.\r\n\r\nThere is a range of accommodation available to suit all budgets, families of different sizes and even large groups – and it’s all just a short walk away from the beach.\r\n\r\nWith ample facilities throughout the park for bathing, laundering and cooking, almost everything you need can be found on site. For shopping needs, the town centre is within easy walking distance. If you’re in the mood for eating out, the park is conveniently located on Bell St – this is also considered to be the café hub of Torquay.\r\n\r\nIf you need anything else, your hosts, Ryan and Kylie Winning, will be pleased to help with any queries or concerns during your stay.', 'Torquay Foreshore Caravan Park', '', 'draft', 'closed', 'closed', '', 'torquay-foreshore-caravan-park', '', '', '2016-02-22 12:21:02', '2016-02-22 12:21:02', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=818', 0, 'park', '', 0),
(819, 1, '2016-02-22 12:19:36', '2016-02-22 12:19:36', '', 'logo', '', 'inherit', 'open', 'closed', '', 'logo-19', '', '', '2016-02-22 12:19:36', '2016-02-22 12:19:36', '', 818, 'http://vicparks.dev/app/uploads/2016/02/logo-12.jpg', 0, 'attachment', 'image/jpeg', 0),
(820, 1, '2016-02-22 12:26:11', '0000-00-00 00:00:00', 'The Lorne Foreshore Caravan Park is superbly located along the beautiful Erskine River and adjacent to Lorne’s main surf beach.\r\n\r\nSituated across 5 fantastic sites, the Park takes in the breathtaking coastal and bush surrounds of Lorne. There are family friendly campsites and onsite self-contained accommodation available.\r\n\r\nThe charm of Lorne is hard to surpass with mild weather, superb cafes and eateries, specialty shops, boutiques, galleries and musical entertainment. It can easily be described as one of the most popular holiday destinations along the famous Great Ocean Road.\r\n\r\nWalking distance from the parks is the Lorne Visitor Information Centre located near the roundabout providing visitors with all they need to know about the area. There are many natural features to enjoy including the sheltered pristine two kilometre beach bordered by lawn, native trees, and picnic & barbecue areas.', 'Lorne Foreshore Caravan Park', '', 'draft', 'closed', 'closed', '', 'lorne-foreshore-caravan-park', '', '', '2016-02-22 12:26:11', '2016-02-22 12:26:11', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=820', 0, 'park', '', 0),
