(822, 1, '2016-02-22 12:31:35', '0000-00-00 00:00:00', 'Great beachside foreshore camping! Very affordable family camping right along the iconic Rosebud, Rye and Sorrento foreshore reserves, every site is metres away from the very popular Port Philip Bay beaches.\r\n\r\nThere are many shady sites. Amenity blocks are centrally located: toilets, hot and cold showers and laundry in each. Shops and public transport are easily accessed.', 'Mornington Peninsula Foreshore Camping', '', 'draft', 'closed', 'closed', '', 'mornington-peninsula-foreshore-camping', '', '', '2016-02-22 12:31:35', '2016-02-22 12:31:35', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=822', 0, 'park', '', 0),
