(824, 1, '2016-02-23 02:16:22', '0000-00-00 00:00:00', 'Amberlee family holidays makes an incredible destination.\r\n\r\nYour self-contained villa boasts a lovely two person spa, full kitchen, bathroom, queen size bed and bunks for the children. Or how about become an owner and an annual member at Amberlee.\r\n\r\nOut and about on the property we have pools, trampolines, tennis court, cricket, basketball, playgrounds, mini golf, footy field and spacious bushland setting.', 'Amberlee Family Holidays', '', 'draft', 'closed', 'closed', '', 'amberlee-family-holidays', '', '', '2016-02-23 02:16:22', '2016-02-23 02:16:22', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=824', 0, 'park', '', 0),
