(826, 1, '2016-02-23 02:22:18', '0000-00-00 00:00:00', 'Hospitality at its Best.\r\n\r\nIf you’re towing a caravan, driving a Motorhome, pitching a tent or staying in our Deluxe Ensuite Cabins you will find the Daylesford Victoria Caravan Park the perfect place to relax. Modern amenities, Camp kitchen and BBQs, children’s playground, old stone hut with open fire and only a short stroll to Lake Daylesford and to the centre of town.\r\n\r\nPets are most welcome at our park in and around our caravan and camping sites.\r\n\r\nIf you’re new to caravanning then the Daylesford Victoria Caravan Park should be the first stop on your maiden voyage as we will take you to your site and assist in any way we can to make sure that your stay is stress free and a happy one.\r\n\r\nLooking forward to welcoming you to our park.\r\n\r\nYour hosts Linda, Mark and Colin.', 'Daylesford Victoria Caravan Park', '', 'draft', 'closed', 'closed', '', 'daylesford-victoria-caravan-park', '', '', '2016-02-23 02:22:18', '2016-02-23 02:22:18', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=826', 0, 'park', '', 0),
