(828, 1, '2016-02-23 02:27:54', '0000-00-00 00:00:00', 'A well maintained, friendly family park 1 kilometre west of town centre. Local features include rivers, gorges, historic buildings, wineries and The Avenue of Honour with roadside produce stalls. Forty minutes to Melbourne Airport and Tasmanian Ferry Terminal.\r\n\r\nPet friendly - conditions apply.', 'Bacchus Marsh Caravan Park', '', 'draft', 'closed', 'closed', '', 'bacchus-marsh-caravan-park', '', '', '2016-02-23 02:27:54', '2016-02-23 02:27:54', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=828', 0, 'park', '', 0),
