(830, 1, '2016-02-23 02:33:03', '0000-00-00 00:00:00', 'Melbourne BIG4 Holiday, Caravan and Camping Park is situated just 9km from the Melbourne CBD… the gateway to Victoria. Here at Melbourne BIG4 we have a range of accommodation and facilities to suit all tastes and budgets. Choose from self-contained luxury villas for up to seven people to budget cabins and ensuite, caravan and camping sites.\r\n\r\nWhen you are not out on the town you can relax by our solar heated pool, cook up a meal in our fully equipped camp kitchen and, no matter the weather, the kids have somewhere to play in our games room or playground.\r\n\r\nMelbourne BIG4 is part of the Watts Holiday Parks group and have built our reputation on providing a complete holiday experience that is truly memorable. We are proudly family owned and operated and as a member of the BIG4 Holiday Parks group you’re guaranteed value for money with world-class standards.', 'Melbourne BIG4 Holiday Park', '', 'draft', 'closed', 'closed', '', 'melbourne-big4-holiday-park', '', '', '2016-02-23 02:33:03', '2016-02-23 02:33:03', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=830', 0, 'park', '', 0),
