(833, 1, '2016-02-23 02:37:57', '0000-00-00 00:00:00', 'Only 69km South East of Melbourne, Stony Point is located on the Western Port side of the Mornington Peninsula. It is a quiet place, a perfect location to relax, enjoy the surroundings or do some fishing.\r\n\r\nOn 4.5 acres of Crown Land, options for accommodation at Stony Point include:-\r\n<ul>\r\n	<li>35 spacious powered site</li>\r\n	<li>7 camp sites</li>\r\n	<li>5 clean, comfortable and affordable cabins, 4 with ensuite.</li>\r\n</ul>\r\nThe park also offers -\r\n<ul>\r\n	<li>semi enclosed camp kitchen equipped with TV, microwave, fridge, hot &amp; cold water and free electric BBQ’s.</li>\r\n</ul>\r\n2km from the HMAS Cerberus navy base, with golf course open to the public.\r\n\r\nAdjacent to the park is the 3 lane Stony Point boat ramp.\r\n\r\nThe Stony Point jetty is just a short walk where you can catch the passenger ferry to French and Phillip Islands.\r\n\r\nA direct train service operates to Frankston and Melbourne from next to the park.', 'Stony Point Caravan Park', '', 'draft', 'closed', 'closed', '', 'stony-point-caravan-park', '', '', '2016-02-23 02:37:57', '2016-02-23 02:37:57', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=833', 0, 'park', '', 0),
(834, 1, '2016-02-23 02:42:48', '0000-00-00 00:00:00', 'Doon Reserve Caravan Park is located in Victoria’s Yarra Valley. An easy 65 minute drive from Melbourne will transport you to the wonderful adventure that is the Yarra Valley.\r\n\r\nThere are family camping sites on the banks of the Yarra. There are so many things to see and do… from natural wonders to fun-filled activities to sites of historical significance. Whether you wish to simply take time out to relax and recoup… explore the gourmet delights of fine food and wine… be inspired by nature and walk amongst the natural beauty of towering eucalypt forests… or taste the abundant array of fresh farm produce…\r\n\r\nDoon reserve is the perfect place to base yourself on your Yarra Valley holiday.', 'Doon Reserve Caravan Park', '', 'draft', 'closed', 'closed', '', 'doon-reserve-caravan-park', '', '', '2016-02-23 02:42:48', '2016-02-23 02:42:48', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=834', 0, 'park', '', 0),
(835, 1, '2016-02-23 02:41:46', '2016-02-23 02:41:46', '', 'log1', '', 'inherit', 'open', 'closed', '', 'log1', '', '', '2016-02-23 02:41:46', '2016-02-23 02:41:46', '', 834, 'http://vicparks.dev/app/uploads/2016/02/log1.jpg', 0, 'attachment', 'image/jpeg', 0),
(836, 1, '2016-02-23 02:47:12', '0000-00-00 00:00:00', 'Chelsea Holiday Park is based just off the Nepean Highway, only 45 minutes from Melbourne.\r\n\r\nThis park offers grassy powered sites, and several lovely tourist cabins available for short and long stays, which sleep up to four.\r\n\r\nThe large outdoor swimming pool, undercover BBQ area and playground make this an ideal park to bring your family, with the added convenience of an onsite coin laundry, milk bar and café.\r\n\r\nThe local area boasts numersous attractions including the Edithvale-Seaford Wetlands system, well known for its colourful bird life, and bicycle tracks that run all the way to Melbourne.', 'Chelsea Holiday Park', '', 'draft', 'closed', 'closed', '', 'chelsea-holiday-park', '', '', '2016-02-23 02:47:12', '2016-02-23 02:47:12', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=836', 0, 'park', '', 0),
(837, 1, '2016-02-23 02:51:19', '0000-00-00 00:00:00', 'Jubilee Lake Holiday Park is located in Victoria’s famous spa country and only 2.5km from Daylesford. Situated on Jubilee Lake you can enjoy fishing, canoeing, bushwalking, and bird watching. There is a huge oval for children to play cricket and leisure activities as well as a playground. Pets are welcome and enjoy open fires and our own mineral spring.\r\n\r\nThere is a lot to do in the area including local cafes, art galleries, wineries, historic streetscapes, golf and horse riding and beautiful scenery. The park offers a range of accommodation for couples and families including self-contained cabins, powered and unpowered sites and bush camping sites. Jubilee Lake Reserve is classified by the national trust as a unique, historical reserve.\r\n\r\nThe Caravan park offers a peaceful and relaxed atmosphere, a well stocked kiosk, clean amenities and friendly staff.', 'Jubilee Lake Holiday Park', '', 'draft', 'closed', 'closed', '', 'jubilee-lake-holiday-park', '', '', '2016-02-23 02:51:19', '2016-02-23 02:51:19', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=837', 0, 'park', '', 0),
(838, 1, '2016-02-23 02:50:32', '2016-02-23 02:50:32', '', 'Logo', '', 'inherit', 'open', 'closed', '', 'logo-20', '', '', '2016-02-23 02:50:32', '2016-02-23 02:50:32', '', 837, 'http://vicparks.dev/app/uploads/2016/02/Logo.png', 0, 'attachment', 'image/png', 0),
(839, 1, '2016-02-23 02:58:31', '0000-00-00 00:00:00', 'Located at the top of the Mornington Peninsula, in a quiet semi-rural setting, we are an ideal base from which to explore the peninsula, Western Port Bay or take a run down to Phillip Island.\r\n\r\nWe are ideally positioned, being about one hour from Melbourne, Sorrento and Phillip Island.\r\n\r\nFor boating enthusiasts, we are next door to Yaringa Marina and 10 minutes from Western Port Marina in Hastings.\r\n\r\nThe Somerville, Tyabb area is the centre of a concentration of antiques shops, while the whole of the peninsula boasts some of the best golf courses and wineries in the state.', 'Western Port Harbour Caravan Park', '', 'draft', 'closed', 'closed', '', 'western-port-harbour-caravan-park', '', '', '2016-02-23 02:58:31', '2016-02-23 02:58:31', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=839', 0, 'park', '', 0),
(841, 1, '2016-02-23 02:56:20', '2016-02-23 02:56:20', '', 'mainimage', '', 'inherit', 'open', 'closed', '', 'mainimage', '', '', '2016-02-23 02:56:20', '2016-02-23 02:56:20', '', 839, 'http://vicparks.dev/app/uploads/2016/02/mainimage.jpg', 0, 'attachment', 'image/jpeg', 0),
(842, 1, '2016-02-23 03:04:00', '0000-00-00 00:00:00', 'Cowes Caravan Park is ideally located “right on the beach”, 1km west of Cowes on Phillip Island.\r\n\r\nFacing a quiet bay beach with fine white sand, it is the perfect family holiday location, with sparkling shallows providing endless entertainment for younger family members. Also ideal for swimming, wind surfing, sail boarding, small yachts and shore based fishing.\r\n\r\nThe unique aspect of this beach is its warm north facing aspect, rarely found in the world. Boat ramp 500m west and a mooring available at the Park.\r\n\r\nFull range of accommodation available – Beachview, Executive, Deluxe and Standard ensuite cabins, Powered and unpowered sites - playground, Recreation room, laundry, BBQs, camp Kitchen and internet available.\r\n\r\nCentrally located to all attractions, only 10 minutes by car to Penguin Parade, Seal Rocks, Grand Prix Circuit and famous surf beaches. A leisurely stroll can be taken along the beach to the many restaurants and cafes.', 'Cowes Caravan Park', '', 'draft', 'closed', 'closed', '', 'cowes-caravan-park', '', '', '2016-02-23 03:04:00', '2016-02-23 03:04:00', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=842', 0, 'park', '', 0),
(843, 1, '2016-02-23 03:02:51', '2016-02-23 03:02:51', '', 'cclogo', '', 'inherit', 'open', 'closed', '', 'cclogo', '', '', '2016-02-23 03:02:51', '2016-02-23 03:02:51', '', 842, 'http://vicparks.dev/app/uploads/2016/02/cclogo.jpg', 0, 'attachment', 'image/jpeg', 0),
(844, 1, '2016-02-23 03:08:25', '0000-00-00 00:00:00', 'Spacious bush setting on 5 lush acres, family friendly park. Close to major attractions, 3km from Grand Prix Circuit, 4km before Cowes township, 8km from the Penguin Parade, opposite Koala Conservation Centre and close to summer patrolled Smith Beach.\r\n\r\nThe park constitutes 1 and 2 bedroom self-contained cabins, very large camp kitchen/TV room with a wood-fired pizza oven and BBQs. Playgrounds and games room.\r\n\r\nAdjacent to park, boasts one of the Island\'s major attractions which entitles park patrons to 20% off at Maze \'n Things theme park, getting lost in the 3D maze and illusion rooms with a maxi/mini golf too. Also 25% off Amazing World of Chocolate Tour too.', 'A Maze\'n Things Holiday Park', '', 'draft', 'closed', 'closed', '', 'a-mazen-things-holiday-park', '', '', '2016-02-23 03:08:25', '2016-02-23 03:08:25', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=844', 0, 'park', '', 0),
(845, 1, '2016-02-23 03:07:43', '2016-02-23 03:07:43', '', 'logom', '', 'inherit', 'open', 'closed', '', 'logom', '', '', '2016-02-23 03:07:43', '2016-02-23 03:07:43', '', 844, 'http://vicparks.dev/app/uploads/2016/02/logom.png', 0, 'attachment', 'image/png', 0),
(846, 1, '2016-02-23 03:14:47', '0000-00-00 00:00:00', 'Beach Park is a quiet family park situated on a popular swimming beach just 800m from Cowes Central.\r\n\r\nBeach frontage, beautiful treed surrounds with large grassy sites, also paved drive through sites make for easy maneuvering. Heated in ground swimming pool (not winter).\r\n\r\n3 styles of cabins, all include bedding, towels, electric blankets and reverse cycle A/C. All have 2 bedrooms with fully self-contained kitchens, bathrooms, decks and outdoor furniture. Beachfront bungalows have veranda and views.', 'Beach Park Tourist Caravan Park', '', 'draft', 'closed', 'closed', '', 'beach-park-tourist-caravan-park', '', '', '2016-02-23 03:14:47', '2016-02-23 03:14:47', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=846', 0, 'park', '', 0),
(847, 1, '2016-02-23 03:13:34', '2016-02-23 03:13:34', '', 'bplogo', '', 'inherit', 'open', 'closed', '', 'bplogo', '', '', '2016-02-23 03:13:34', '2016-02-23 03:13:34', '', 846, 'http://vicparks.dev/app/uploads/2016/02/bplogo.jpg', 0, 'attachment', 'image/jpeg', 0),
(848, 1, '2016-02-23 06:14:08', '0000-00-00 00:00:00', 'Anchor Belle Holiday Park is the ideal holiday destination. Located 90km from Melbourne. At Cowes, Phillip Island, a friendly family park set amongst 5 acres of bush, 100m to beach and just 2km from the main shops and restaurants.\r\n\r\nThe park features heated indoor pool, free BBQs and camp kitchen, children’s playground; grassed sites, sheltered tent sites, tranquil bush setting, 100m direct access to beach, non-smoking accommodation, modern clean facilities. Anchor Belle Holiday Park offers Deluxe Cabins, which feature 2 bedrooms, the main having a queen bed and the 2nd bedroom with 2 sets of bunks, full size oven, microwave, 2-door fridge freezer, reverse cycle air-conditioning, large TV with DVD player, 2 x 2 seater couches, linen and towels are supplied to queen bed.\r\n\r\nAnchor Belle Holiday Park is central to all natural attractions. The park features an indoor heated pool, BBQs, camp kitchen, children’s playgrounds, free Playstation games. Relax and enjoy your stay at this highly rated park.', 'Anchor Belle Holiday Park', '', 'draft', 'closed', 'closed', '', 'anchor-belle-holiday-park', '', '', '2016-02-23 06:14:08', '2016-02-23 06:14:08', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=848', 0, 'park', '', 0),
(849, 1, '2016-02-23 06:12:44', '2016-02-23 06:12:44', '', 'Anchor-Belle-Logo-TRANS-resized', '', 'inherit', 'open', 'closed', '', 'anchor-belle-logo-trans-resized', '', '', '2016-02-23 06:12:44', '2016-02-23 06:12:44', '', 848, 'http://vicparks.dev/app/uploads/2016/02/Anchor-Belle-Logo-TRANS-resized.png', 0, 'attachment', 'image/png', 0),
(850, 1, '2016-02-23 06:19:21', '0000-00-00 00:00:00', 'Just 3.5 hours drive from Melbourne or 5 hours from Adelaide a scenic masterpiece awaits. Located within the small tourist town of Halls Gap. Halls Gap Caravan and Tourist Park is one of the Grampians oldest camping grounds.\r\n\r\nBounded on all sides by a National Park, this area is home to some of the most breathtaking views found anywhere in Australia. From 4 star Log Cabins and Spa Units to our Superior Queen Units and Powered Camping Sites, we have accommodation to suit your lifestyle and kids will enjoy the play areas.\r\n\r\nThe Grampians National Park offers something for everyone. For the adventurous there is bushwalking, mountain hiking, abseiling and four wheel driving. Canoeing and fishing are popular in nearby lakes. The National Park is famous for sightseeing, sparkling waterfalls and high altitude lookouts, and the region has excellent wineries.', 'Halls Gap Caravan Park', '', 'draft', 'closed', 'closed', '', 'halls-gap-caravan-park', '', '', '2016-02-23 06:19:21', '2016-02-23 06:19:21', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=850', 0, 'park', '', 0),
(851, 1, '2016-02-23 06:17:35', '2016-02-23 06:17:35', '', 'Halls-Gap-Caravan-Park-header3', '', 'inherit', 'open', 'closed', '', 'halls-gap-caravan-park-header3', '', '', '2016-02-23 06:17:35', '2016-02-23 06:17:35', '', 850, 'http://vicparks.dev/app/uploads/2016/02/Halls-Gap-Caravan-Park-header3.png', 0, 'attachment', 'image/png', 0),
(852, 1, '2016-02-23 06:41:03', '0000-00-00 00:00:00', 'Our family run park provides an excellent range of reasonably priced accommodation to suit your budget and requirements including: Ensuite Cabins, Holiday Units, Powered and Unpowered sites.\n\nAcacia Caravan Park offers shady sites in a relaxed setting. We have drive through sites available which can accommodate larger caravans and motorhomes.\n\nFacilities include camp kitchen, free BBQ, playground, and a swimming pool - perfect on a hot summer\'s day.\n\nThe park is located within walking distance to the centre of the rural city of Ararat. It is an ideal base to explore the wide variety of regional attractions and is the gateway to the Grampians National Park.', 'Acacia Caravan & Tourist Park', '', 'draft', 'closed', 'closed', '', 'acacia-caravan-tourist-park', '', '', '2016-02-23 06:41:03', '2016-02-23 06:41:03', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=852', 0, 'park', '', 0),
(853, 1, '2016-02-23 06:39:54', '2016-02-23 06:39:54', '', 'logoac', '', 'inherit', 'open', 'closed', '', 'logoac', '', '', '2016-02-23 06:39:54', '2016-02-23 06:39:54', '', 852, 'http://vicparks.dev/app/uploads/2016/02/logoac.png', 0, 'attachment', 'image/png', 0),
(854, 1, '2016-02-23 06:45:38', '0000-00-00 00:00:00', 'Takaru Grampians is located in the heart of the Grampians National Park just 3kms from Halls Gap at the base of Lake Bellfield. The park is a wildlife sanctuary in its own right with visits from deer, kangaroos and rosellas that can be hand fed.\r\n\r\nTakaru Grampians offers accommodation to suit all budgets and families alike. Choose from cabins that sleep up to six, deluxe style spa accommodation, or powered and unpowered camp sites. We can arrange activities for large bookings or groups, designed around your requirements. For caravans or motor homes we offer individual taps, with sullage and power.\r\n\r\nWith camp fires, fishing in the nearby lake, a children’s playground, swimming pool and bike hire, there is something for everyone! Located just three hours drive from Melbourne, our staff will assist you to plan a wilderness adventure or a relaxing escape.', 'Halls Gap Lakeside Tourist Park', '', 'draft', 'closed', 'closed', '', 'halls-gap-lakeside-tourist-park', '', '', '2016-02-23 06:45:38', '2016-02-23 06:45:38', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=854', 0, 'park', '', 0),
(855, 1, '2016-02-23 06:44:30', '2016-02-23 06:44:30', '', 'banner', '', 'inherit', 'open', 'closed', '', 'banner', '', '', '2016-02-23 06:44:30', '2016-02-23 06:44:30', '', 854, 'http://vicparks.dev/app/uploads/2016/02/banner.jpg', 0, 'attachment', 'image/jpeg', 0),
(857, 1, '2016-02-23 06:50:25', '0000-00-00 00:00:00', 'Lake Hamilton Motor Village &amp; Caravan Park is proudly a Top Tourist Park. It is the ideal place to stay in Hamilton and tour the Grampians and Volcano Region including Nigretta &amp; Wannon Falls.\r\n\r\nOur accommodation is superbly appointed, with all bedding and linen provided and is ideal for the corporate traveller seeking lots of room, families that require room to play or just a getaway for couples.\r\n\r\nWe offer a choice of fully self-contained 2 and 1 bedroom cabins, whilst caravaners can choose ensuite, grassed or drive-thru sites. The Park has over 200 ornamental flowering trees providing shade, privacy and ambiance. Enjoy our free BBQ or take a short stroll to Hamilton city centre to shops, hotels and restaurants.\r\n\r\nSituated on the banks of the Grange Burn River, opposite Lake Hamilton with excellent walking and bike tracks. Pets love the freedom of the adjacent parkland.', 'Lake Hamilton Motor Village & Caravan Park', '', 'draft', 'closed', 'closed', '', 'lake-hamilton-motor-village-caravan-park', '', '', '2016-02-23 06:50:25', '2016-02-23 06:50:25', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=857', 0, 'park', '', 0),
(858, 1, '2016-02-23 06:49:46', '2016-02-23 06:49:46', '', 'logohm', '', 'inherit', 'open', 'closed', '', 'logohm', '', '', '2016-02-23 06:49:46', '2016-02-23 06:49:46', '', 857, 'http://vicparks.dev/app/uploads/2016/02/logohm.png', 0, 'attachment', 'image/png', 0),
(859, 1, '2016-02-23 06:54:39', '0000-00-00 00:00:00', 'We provide accommodation for visitors to Wodonga and Albury with quick access on and off the Hume Freeway. Our caravan and cabin park is the closest accommodation to the new Wodonga Railway Station, 2 minutes drive from the Wodonga Town Centre and 10 minutes drive to Albury.\r\n\r\nBook a fully self-contained ensuite cabin or tourist site and use our park as a base to explore the many sporting or tourist attractions of the Albury-Wodonga region.\r\n\r\nBookings can be made online.', 'Wodonga Caravan & Cabin Park', '', 'draft', 'closed', 'closed', '', 'wodonga-caravan-cabin-park', '', '', '2016-02-23 06:54:39', '2016-02-23 06:54:39', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=859', 0, 'park', '', 0),
