(861, 1, '2016-02-23 07:14:29', '0000-00-00 00:00:00', 'Cobram Willows Caravan Park is a small, quiet, clean and friendly park. Located 1.6km from the town centre.\r\n\r\nLarge shady sites with some annex pads and some grass sites. Close to clubs, golf, bowls, tennis, wineries and the Murray River. Courtesy bus to clubs.\r\n\r\nA central spot to stay and explore the region.', 'The Cobram Willows Caravan Park', '', 'draft', 'closed', 'closed', '', 'the-cobram-willows-caravan-park', '', '', '2016-02-23 07:14:29', '2016-02-23 07:14:29', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=861', 0, 'park', '', 0),
