(863, 1, '2016-02-23 07:22:42', '0000-00-00 00:00:00', 'Set on 68 acres of natural bushland, this family owned and operated Holiday Resort is the perfect destination for couples and families alike.\r\n\r\nOur pioneer-themed village of 1 and 2 bedroom holiday cabins have absolute river frontage. Inland Settlers Cottages and Studio Units surround the resort-style swimming pool. Other features include powered and unpowered camp sites, 4 land boat ramp, games room, camp kitchen, kiosk and BBQ rotundas.', 'Merool on the Murray', '', 'draft', 'closed', 'closed', '', 'merool-on-the-murray', '', '', '2016-02-23 07:22:42', '2016-02-23 07:22:42', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=863', 0, 'park', '', 0),
(864, 1, '2016-02-23 07:21:31', '2016-02-23 07:21:31', '', 'logo_meroolonthemurray', '', 'inherit', 'open', 'closed', '', 'logo_meroolonthemurray', '', '', '2016-02-23 07:21:31', '2016-02-23 07:21:31', '', 863, 'http://vicparks.dev/app/uploads/2016/02/logo_meroolonthemurray.gif', 0, 'attachment', 'image/gif', 0),
(865, 1, '2016-02-23 07:36:28', '0000-00-00 00:00:00', 'Stay at Ball Park Caravan Park, located on the banks of the Murray River, beside the historical John Foord Bridge, just minutes away from the Rutherglen Wine Region. Ball Park Caravan Park is only a minute walk to the town centre of Corowa and Wahgunyah, and adjoins the Olympic size town pool, tennis courts and Bowling Greens.\r\n\r\nYou will be able to explore historic Corowa, the ‘Birth Place of Federation’, enjoy the magnificent 27 hole championship golf course and taste the wonderful wines Wahgunyah and Rutherglen have to offer.\r\n\r\nOur spacious park has excellent facilities; including Camp Kitchen, 3 BBQ areas, jumping pillow and playground area for the children, boat ramp and river access. This Park provides a wide range of accommodation, from self-contained cabins, to powered and unpowered camp sites. All our cabins are non- smoking and range from luxury villas to open planned standards, all with ensuites, reverse cycle air-conditioning and TV’s.', 'Ball Park Caravan Park', '', 'draft', 'closed', 'closed', '', 'ball-park-caravan-park', '', '', '2016-02-23 07:36:28', '2016-02-23 07:36:28', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=865', 0, 'park', '', 0),
(866, 1, '2016-02-23 07:28:01', '2016-02-23 07:28:01', '', 'cblogo', '', 'inherit', 'open', 'closed', '', 'cblogo', '', '', '2016-02-23 07:28:01', '2016-02-23 07:28:01', '', 865, 'http://vicparks.dev/app/uploads/2016/02/cblogo.jpg', 0, 'attachment', 'image/jpeg', 0),
(867, 1, '2016-02-23 07:47:18', '0000-00-00 00:00:00', 'BIG4 Yarrawonga-Mulwala Lakeside Holiday Park is located opposite the boat ramp at Lake Mulwala, 4km from Yarrawonga in the beautiful town of Mulwala, NSW.\r\n\r\nAn aquatic paradise where you can fish, water ski and relax. We have 2 pools, and inflatable trampoline, tennis court, games and theatre rooms.\r\n\r\nCourtesy bus to local clubs.', 'BIG4 Yarrawonga-Mulwala Lakeside Holiday Park', '', 'draft', 'closed', 'closed', '', 'big4-yarrawonga-mulwala-lakeside-holiday-park', '', '', '2016-02-23 07:47:18', '2016-02-23 07:47:18', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=867', 0, 'park', '', 0),
(868, 1, '2016-02-23 07:45:56', '2016-02-23 07:45:56', '', 'cchp-lakeside-header-logo', '', 'inherit', 'open', 'closed', '', 'cchp-lakeside-header-logo', '', '', '2016-02-23 07:45:56', '2016-02-23 07:45:56', '', 867, 'http://vicparks.dev/app/uploads/2016/02/cchp-lakeside-header-logo.jpg', 0, 'attachment', 'image/jpeg', 0),
(869, 1, '2016-02-23 07:54:24', '0000-00-00 00:00:00', 'Escape to Time Out! A picturesque nature park, situated near Tocumwal NSW, on the Victorian side of the Murray River. With a private beachfront and 400 acres of tranquil bushland, our park is teeming with native flora and fauna!\r\n\r\nTime Out is the perfect location to relax, as you can set up camp in a secluded spot and immerse yourself in the natural surroundings. Our park is also excellent for those seeking some adventure! With hundreds of kilometres of 4WD, bike &amp; walking tracks, plus various water sport activities along the Murray River, you’ll be entertained for hours!\r\n\r\nAvailable accommodation at Time Out includes sites for short term, long term, and annual stays.\r\n\r\nOur Park provides a great atmosphere for overnight stays, travellers of all ages, and families. If you’re looking for the perfect getaway Time Out Holiday Park is the place for you!', 'Time Out Holiday Park', '', 'draft', 'closed', 'closed', '', 'time-out-holiday-park', '', '', '2016-02-23 07:54:24', '2016-02-23 07:54:24', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=869', 0, 'park', '', 0),
(870, 1, '2016-02-23 08:00:04', '0000-00-00 00:00:00', 'Yarrawonga Holiday Park is situated on the beautiful Murray River, just downstream from Yarrawonga Weir - perfectly situated for your holiday!\r\n\r\nYarrawonga and Mulwala have plenty to see and do, but with our first class facilities and accommodation options, Yarrawonga Holiday Park is a destination in itself.\r\n\r\nFrom our luxury riverview cabins, deluxe cabins, standard cabins, powered or unpowered caravan and camping sites, you will find fantastic accommodation to suit your style and budget. All boating activities can be accessed via the public boat ramp in the Park or the nearby lake. You can enjoy paddling in the river from the beach/boat ramp area or the children can safely play in the fully-fenced playground. The grassed areas are plentiful and there are synthetic bowling greens to use at your leisure.\r\n\r\nThe local footy oval and grassed tennis courts situated in the Park are available for our patrons to access and the public swimming pool is easy to access via a gate in our boundary fence.', 'Yarrawonga Holiday Park', '', 'draft', 'closed', 'closed', '', 'yarrawonga-holiday-park', '', '', '2016-02-23 08:00:04', '2016-02-23 08:00:04', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=870', 0, 'park', '', 0),
(871, 1, '2016-02-23 07:58:58', '2016-02-23 07:58:58', '', 'logoyh', '', 'inherit', 'open', 'closed', '', 'logoyh', '', '', '2016-02-23 07:58:58', '2016-02-23 07:58:58', '', 870, 'http://vicparks.dev/app/uploads/2016/02/logoyh.jpg', 0, 'attachment', 'image/jpeg', 0),
(872, 1, '2016-02-23 08:37:06', '0000-00-00 00:00:00', 'Nestled along the banks of the Edward River, alongside the sandy shore of NSW\'s largest inland river beach, lies McLean Beach Holiday Park, Deniliquin. Surrounded on three sides by the broad and tranquil Edward River, the park is a private water lovers paradise, perfect for fishing, water skiing or just relaxing by the beach. There is a large boat ramp at the entrance of the park and plenty of space for boat parking within.\r\n\r\nWe offer a great range of accommodation to suit, from a shady site for a van or tent, or to our self-contained cabins.\r\n\r\nFor the kids we have a giant jumping cushion, full playground, giant chess set and basketball hoop, all protected under large shade sails. We also have great paths inside and outside the park for kids to ride their bikes on.\r\n\r\nEnjoy the peaceful surrounds of our park, and still be within a 2 minute stroll of the town centre where there are cafes, bakeries, pubs and clubs aplently. With more sunshine days than the Gold Coast, Deniliquin really is an oasis on the edge of the outback and yet only a 3 hour drive from Melbourne.', 'McLean Beach Holiday Park', '', 'draft', 'closed', 'closed', '', 'mclean-beach-holiday-park', '', '', '2016-02-23 08:37:06', '2016-02-23 08:37:06', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=872', 0, 'park', '', 0),
(873, 1, '2016-02-23 08:35:10', '2016-02-23 08:35:10', '', 'mcloggo', '', 'inherit', 'open', 'closed', '', 'mcloggo', '', '', '2016-02-23 08:35:10', '2016-02-23 08:35:10', '', 872, 'http://vicparks.dev/app/uploads/2016/02/mcloggo.jpg', 0, 'attachment', 'image/jpeg', 0),
(874, 1, '2016-02-23 08:48:01', '0000-00-00 00:00:00', 'BIG4 Cross Roads Holiday Park is the closest park to Mildura CBD, providing quality accommodation for all.\r\n\r\nGrassed ensuite and powered sites suitable for any sized rig. Valet parking if required.', 'BIG4 Cross Roads Holiday Park', '', 'draft', 'closed', 'closed', '', 'big4-cross-roads-holiday-park', '', '', '2016-02-23 08:48:01', '2016-02-23 08:48:01', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=874', 0, 'park', '', 0),
