(876, 1, '2016-02-23 08:54:57', '0000-00-00 00:00:00', 'Marysville Caravan and Holiday Park has something for everyone. Relax by the river and enjoy the mountain views, bird life and the best of nature. We are set at the foot of Lake Mountain in the heart of Marysville. The perfect location for snow activities, walking tracks, a round of golf, fishing or mountain bike riding. Of course, you may just choose to sit by the river which meanders through the middle of the holiday park and relax.\r\n\r\nWe have a number of different styles of accommodation. All cabins have two bedrooms. Ensuite, TV/DVD, kitchen, heating and cooling. 2-9 people.', 'Marysville Caravan and Holiday Park', '', 'draft', 'closed', 'closed', '', 'marysville-caravan-and-holiday-park', '', '', '2016-02-23 08:54:57', '2016-02-23 08:54:57', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=876', 0, 'park', '', 0),
(877, 1, '2016-02-23 08:53:11', '2016-02-23 08:53:11', '', 'logonnm', '', 'inherit', 'open', 'closed', '', 'logonnm', '', '', '2016-02-23 08:53:11', '2016-02-23 08:53:11', '', 876, 'http://vicparks.dev/app/uploads/2016/02/logonnm.png', 0, 'attachment', 'image/png', 0),
(878, 1, '2016-02-23 09:02:31', '0000-00-00 00:00:00', 'Our Park is situated on the banks of the Ovens River with its pristine waters, great trout fishing and many leisure activities.\r\n\r\nWe offer large shady river powered and unpowered camping sites, modern cabins ranging from budget to executive, an in-ground swimming pool, playground, kiosk, clean amenities, and a friendly welcome!\r\n\r\nNestled in the foothills of picturesque Mt Buffalo, we are a short walk to the local shops and hotel, a 25 minute drive to Mt Buffalo and five minutes to the tourist town of Bright, where restaurants, wineries, bars and interesting shops will keep you on the go all day.\r\n\r\nOur area offers the outdoor enthusiast an array of exciting activities from bushwalking or cycling, to more extreme sports such as downhill mountain biking, abseiling or paragliding. Exploring our magnificent valleys, mountains and rivers is the perfect way to unwind and enjoy the unsurpassable vista of wonderful North East Victoria.', 'Porepunkah Bridge Caravan Park', '', 'draft', 'closed', 'closed', '', 'porepunkah-bridge-caravan-park', '', '', '2016-02-23 09:02:31', '2016-02-23 09:02:31', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=878', 0, 'park', '', 0),
(879, 1, '2016-02-23 09:00:51', '2016-02-23 09:00:51', '', '69308', '', 'inherit', 'open', 'closed', '', '69308', '', '', '2016-02-23 09:00:51', '2016-02-23 09:00:51', '', 878, 'http://vicparks.dev/app/uploads/2016/02/69308.jpg', 0, 'attachment', 'image/jpeg', 0),
(880, 1, '2016-02-23 09:09:54', '0000-00-00 00:00:00', 'Beechworth Lake Sambell Caravan Park is located on the banks of Lake Sambell and is only minutes away from the centre of Historic Beechworth in North East Victoria.\r\n\r\nThe caravan park offers shaded powered sites or un-powered camping, 14 ensuite cabins catering for all budgets and 6 on-site caravans. It boasts a very clean amenities block, campers kitchen, laundry, clothes dryer and baby bath, under cover BBQ areas, playground, mini golf, volleyball court, LPG and a well-stocked kiosk. Pets are accepted in guests own accommodation during off-peak times.\r\n\r\nYou can also enjoy other recreational activities such as bike riding around town, along the Rail Trail or fishing and swimming in the lake. Take advantage of our on-site recreational activities and hire yourself a canoe or kayak to explore Lake Sambell, or a mountain bike to ride the trails.', 'Beechworth Lake Sambell Caravan Park', '', 'draft', 'closed', 'closed', '', 'beechworth-lake-sambell-caravan-park', '', '', '2016-02-23 09:09:54', '2016-02-23 09:09:54', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=880', 0, 'park', '', 0),
(881, 1, '2016-02-23 09:08:45', '2016-02-23 09:08:45', '', 'logolc', '', 'inherit', 'open', 'closed', '', 'logolc', '', '', '2016-02-23 09:08:45', '2016-02-23 09:08:45', '', 880, 'http://vicparks.dev/app/uploads/2016/02/logolc.png', 0, 'attachment', 'image/png', 0),
(882, 1, '2016-02-23 09:17:06', '0000-00-00 00:00:00', 'Big4 Porepunkah Holiday Park is a wonderful quiet rural Park with spectacular views of Mount Buffalo. Just a few minutes drive from Bright. A destination for all seasons with easy access to the snow fields; amazing autumn colours; spring gardens and in summer you can choose to cool off in the pool or maybe you would prefer the Ovens River which is situated at the back of the park.\r\n\r\nWe really are sitting pretty with the bike/walking track, river, wineries and national parks all so close. Every season has its own unique beauty and mother nature always puts on a show which we celebrate with lots of year round festivals.\r\n\r\nWhen you visit you can do as much or as little as you like. For families the jumping pillow, pool and cycling usually keeps the children and parents busy and then you can relax in the evenings and take in the views.', 'BIG4 Porepunkah Holiday Park', '', 'draft', 'closed', 'closed', '', 'big4-porepunkah-holiday-park', '', '', '2016-02-23 09:17:06', '2016-02-23 09:17:06', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=882', 0, 'park', '', 0),
(883, 1, '2016-02-23 10:33:14', '0000-00-00 00:00:00', 'Alexandra Tourist Park is situated on 10 acres of land 1km west of the township of Alexandra which is regarded as the commercial hub of the Shire of Murrindindi.\r\n\r\nWe offer deluxe cabins, standard cabins and studio units, powered sites and unpowered sites are also available. There is a recreation room for use for all our guests. The amenities block and laundry are spotless.\r\n\r\nOur location is ideal as we are centrally located within a short scenic drive to the east to Lake Eildon, and to the south, the historic township of Marysville. A short drive from Marysville will take you to Lake Mountain, which is renowned for its cross-country skiing. Driving further south through the Mystic Mountains, you will enter the Yarra Ranges.', 'Alexandra Tourist Park', '', 'draft', 'closed', 'closed', '', 'alexandra-tourist-park', '', '', '2016-02-23 10:33:14', '2016-02-23 10:33:14', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=883', 0, 'park', '', 0),
(884, 1, '2016-02-23 10:38:48', '0000-00-00 00:00:00', 'BIG4 Taggerty is a country Park on the banks of the Acheron River at Taggerty in North Eastern Victoria. We are at the foothills of the Cathedral Ranges, near Mountain Lake and towns such as Marysville, Alexandra, Eildon and Narbethon.\r\n\r\nSummer is a lovely time to visit and the rains this year have made the foliage and flora even more stunning. A variety of affordable fully self-contained, air-conditioned/heated 2 bedroom ensuited cabins with either queen bed (fully made up) or double beds with doonas and electric blankets supplied.\r\n\r\nLarge spacious powered and unpowered shaded grassed sites. A great country Park with a backdrop of the Cathedral Ranges.', 'BIG4 Taggerty Holiday Park', '', 'draft', 'closed', 'closed', '', 'big4-taggerty-holiday-park', '', '', '2016-02-23 10:38:48', '2016-02-23 10:38:48', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=884', 0, 'park', '', 0),
(885, 1, '2016-02-23 10:56:40', '0000-00-00 00:00:00', 'We offer first class facilities, amongst superb established trees and gardens within a short walk to the town centre, with privacy, safety, security and a warm welcome… perfect.\r\n\r\nSo close to all Bright has to offer. Ovens River and Morses Creek, restaurants and shops, trout fishing, snow skiing, trekking, short and long walks, paragliding, abseiling, adventure tours, Murray to Mountains Rail Trail, bike hire, golf course and just a stroll across the road we have the bowling club.', 'Bright Pine Valley Tourist Park', '', 'draft', 'closed', 'closed', '', 'bright-pine-valley-tourist-park', '', '', '2016-02-23 10:56:40', '2016-02-23 10:56:40', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=885', 0, 'park', '', 0) ;
