(886, 1, '2016-02-23 11:08:23', '0000-00-00 00:00:00', 'Ardern\'s Caravan Park is a family friendly park situated in the Ovens Valley approximately 600 metres from the Myrtleford Post Office. It is adjacent to the Murray to the Mountains Rail Trail and backs on to the Happy Valley Creek.\n\nArdern\'s Caravan Park is an ideal spot for you to discover this amazing area with it\'s stunning scenery and a host of tourist attractions.\n\nPlease call 03 5752 1394 for bookings.\n\nFind us on Facebook/Ardernscaravan', 'Ardern\'s Caravan Park', '', 'draft', 'closed', 'closed', '', 'arderns-caravan-park', '', '', '2016-02-23 11:08:23', '2016-02-23 11:08:23', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=886', 0, 'park', '', 0),
(887, 1, '2016-02-23 11:16:50', '0000-00-00 00:00:00', 'This immaculately kept family caravan park is just the spot you’re looking for, set in beautiful valleys surrounded by rolling hills and the pristine, fish filled, Goulburn River. The Park is only a 5 minute drive form the Alexandra township and is hidden away, surrounded by farm lands occupied by meandering cows and grazing sheep. It’s as if time stops when you enter this place, your senses are filled with the crisp scent of the Australian eucalypt. The sparkling cool waters of the Goulburn River are heaven sent during those hot summer days.\r\n\r\nThe Breakaway Twin Rivers Caravan Park provides accommodation for families, singles and couples plus there are beautiful camping spots along the rivers edge and brand new air-conditioned cabins that have all the latest mod-cons. It’s the perfect place for a short-break or family holiday. Only 2 hours from Melbourne airport and just over an hour from the north eastern suburbs it’s an easy drive to land in a place that leaves you feeling like you’ve been to heaven and back. With many activities for the kids from solar heated pool, mini golf, playground, go-karts and much more.', 'Breakaway Twin Rivers Caravan Park', '', 'draft', 'closed', 'closed', '', 'breakaway-twin-rivers-caravan-park', '', '', '2016-02-23 11:16:50', '2016-02-23 11:16:50', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=887', 0, 'park', '', 0),
(888, 1, '2016-02-23 11:21:50', '0000-00-00 00:00:00', 'Looking for a haven close to Melbourne where you can just kick back and recharge the batteries? Maybe a getaway for the entire family with an abundance of activities: jumping pillow, playgrounds, large pool, hames room, something for everyone in, on or out of the water.\r\n\r\nBut the truth is, you won\'t even need to leave the Nagambie Lakes Leisure Park to have the time of your life. With accommodation and first class amenities - luxury cabins on the riverbank, powered caravan sites or ensuite sites - you can read a book or dangle a line under the shade of an old river red gum, have a game of tennis, row a boat, water ski, swim in the pool, eat in the fabulous Chinaman\'s Bridge Cafe...or perhaps you just want to fire up the BBQ and have a drink or three as you look out on the Goulburn River and watch the sunset.', 'Nagambie Lakes Leisure Park', '', 'draft', 'closed', 'closed', '', 'nagambie-lakes-leisure-park', '', '', '2016-02-23 11:21:50', '2016-02-23 11:21:50', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=888', 0, 'park', '', 0),
(889, 1, '2016-02-23 11:27:19', '0000-00-00 00:00:00', '<div>\n\nCome and meet Sandi, Lou and Pirra and share in the beauty within the Omeo Caravan Park. Our beautiful tree-lined park is situated adjacent to the Livingston Creek in the township of Omeo.\n\nWe are just a short walk into the historic town of Omeo and just a 40-minute drive to Mount Hotham and Dinner Plain.\n\nOur friendly, family owned and operated park offers deluxe self-contained air-conditioned cabins, on-site caravans, playground, TV/Games room, BBQ area, camp kitchen, laundry/drying facilities and hot showers in heated shower block.\n\nWe have 5 acres of large powered and unpowered sites, campfires are allowed and pets are welcome.\n\nCome along and discover the Omeo region in all its glory in Summer, Autumn, Winter and Spring.  Arrive and refresh, breathing in the wonderful mountain air.\n\nCome on over and stay and play on the creek with us……\n\n</div>', 'Omeo Caravan Park', '', 'draft', 'closed', 'closed', '', 'omeo-caravan-park', '', '', '2016-02-23 11:27:19', '2016-02-23 11:27:19', '', 0, 'http://vicparks.dev/?post_type=park&#038;p=889', 0, 'park', '', 0),
