(916, 1, '2016-02-25 04:56:42', '2016-02-25 04:56:42', 'Changes to uncollected goods requirements will affect accommodation providers and a wide range of service industries from 1 September 2012.\r\n\r\nThere will also be changes to accommodation providers’ liability if guests’ property is damaged or lost.\r\n\r\nThe changes under the Australian Consumer Law and Fair Trading Act 2012 cover:\r\n\r\n<strong>Uncollected goods or vehicles</strong>\r\n\r\nThese are items that someone has left temporarily with a business, but:\r\n<ul>\r\n	<li>has not returned to claim or collect</li>\r\n	<li>has not told the business what to do with</li>\r\n	<li>cannot be contacted about, or has not paid the business any costs associated with keeping (also known as ‘the relevant charge’).</li>\r\n</ul>\r\nThe new provisions will set different requirements for informing consumers and for disposing of:\r\n<ul>\r\n	<li>low-value goods (less than $200)</li>\r\n	<li>low-value vehicles (less than $1000)</li>\r\n	<li>medium-value goods ($200-$4999)</li>\r\n	<li>high-value goods ($5000 or more)</li>\r\n	<li>high-value motor vehicles ($1000 or more) perishable goods.</li>\r\n</ul>\r\nSituations that can result in uncollected goods or vehicles include:\r\n<ul>\r\n	<li>A towing business picks up a damaged vehicle, but is not told by the owner what to do with it.</li>\r\n	<li>A motor mechanic is asked to repair a car, but the owner never returns to pick it up and pay for any work done.</li>\r\n	<li>Clothes are left for dry-cleaning but never collected.</li>\r\n	<li>A landlord of a shop is left with perishable food after the tenant leaves.</li>\r\n	<li>A guest fails to return to collect belongings left in a hotel ‘lost and found’. We will soon publish more details about the uncollected goods requirements on this website.</li>\r\n</ul>\r\n<strong>Accommodation provider liability</strong>\r\n\r\nHotels and other accommodation providers will be able to limit their liability if guests’ property is damaged or lost, to:\r\n<ul>\r\n	<li>$300 for each room provided for guests’ use on the day, unless the property was in a safe-keeping service (up from the previous limit of $100)</li>\r\n	<li>$3000 for each room, if the property was in a safe-keeping service (not a room safe) – up from $2000.</li>\r\n</ul>\r\nTo limit liability, accommodation providers must comply with revised notice requirements. If they do not replace existing notices, they may be unable to do so.\r\n\r\nAccommodation providers must:\r\n<ul>\r\n	<li>‘conspicuously’ display the notice at reception or the main entrance, and</li>\r\n	<li>either conspicuously display the notice in the guest’s room, or give it to guests and draw their attention to it – for example, including the wording on a check-in form.</li>\r\n</ul>\r\nProviders who want to limit their liability will have until 1 October 2012 to replace existing notices.\r\n\r\nWe have created a standard notice, in A4 and A5, for businesses to use: (Accommodation providers\' liability standard notice from 1 September 2012 - (see attachment)\r\n\r\nProviders can create their own notice but must use the exact words of the standard: Accommodation providers\' liability standard notice text from 1 September 2012 (see attachment)\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Accommodation-providers-liability-standard-notice-A4-word.doc">Accommodation providers\' liability standard notice text from 1 September 2012</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/accommodation-providers-liability-standard-notice-a4-pdf.pdf">Accommodation providers liability standard notice from 1 September 2012</a>', 'Changes affecting service industries from 1 September 2012 - Legislation Update', '', 'publish', 'closed', 'closed', '', 'changes-affecting-service-industries-from-1-september-2012-legislation-update', '', '', '2016-02-25 04:56:42', '2016-02-25 04:56:42', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=916', 0, 'information-topics', '', 0),
