(921, 1, '2016-02-25 14:14:36', '2016-02-25 14:14:36', 'Accreditation provides parks with a framework of quality business practices in the areas of Business Planning, Risk Management, Environmental Management, Human Resources Management, Marketing and Customer Service. The implementation of accreditation is a step by step process that requires parks to create an individualised operations manual that addresses all of the key business management areas. The Victorian Caravan Parks Association supports the concept of accreditation and would like encourage all member parks to consider its benefits. For information about the Caravan, RV and Accommodation Industry of Australia (CRVA) Accreditation program, please download the following PDF\'s:\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/CRVA_Accreditation_Application.pdf">CRVA Accreditation Guide &amp; Application.</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/CRVA_Accreditation_Self-help_documents.pdf">CRVA Accreditation Self Help Documents.</a>', 'Accreditation', '', 'publish', 'closed', 'closed', '', 'accreditation', '', '', '2016-02-25 14:14:36', '2016-02-25 14:14:36', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=921', 0, 'information-topics', '', 0),
