(969, 1, '2016-02-26 06:46:52', '2016-02-26 06:46:52', 'To provide for the safety and amenity of people who use them, caravan parks are regulated in Victoria by the Residential Tenancies (Caravan parks and Movable Dwellings Registration and Standards) Regulations 2010. These regulations are administered by the Minister for Planning. The Regulations, which came into effect on 27 June 2010, provide for the health and safety of park users. They also set standards for the construction of park cabins. They do not cover the manufacture of caravans or campervans which, as road vehicles, have separate standards.\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Residential-Tenancies-Caravan-Parks-and-Movable-Dwellings-Registration-and-Standards-Regulations-2010-Word_0.pdf">Residential Tenancies (Caravan Parks and Movable Dwelllings Registration and Standards) Regulations 2010 Amended November 2012</a>', 'Residential Tenancies (Caravan Parks & Movable DwellingsRegistration and Standards) Regulations 2010)', '', 'publish', 'closed', 'closed', '', 'residential-tenancies-caravan-parks-movable-dwellingsregistration-and-standards-regulations-2010', '', '', '2016-02-26 06:46:52', '2016-02-26 06:46:52', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=969', 0, 'information-topics', '', 0),
