(971, 1, '2016-02-26 06:52:49', '2016-02-26 06:52:49', 'The Guide to Victoria\'s Caravan Park Regulations was developed with the assistance of stakeholders, including the Victorian Caravan Parks Association, CFA and the Municipal Association of Victoria.\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/1-2034493-Caravan_Park_Regulations_Guide_Version_2_September_2011.pdf">Guide to Victoria\'s Caravan Park Regulations - September 2011</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/1-1695190-A_Guide_to_Victoria_s_Caravan_Park_Regulations_-_December_2010.pdf">Guide to Victoria\'s Caravan Park Regulations - December 2010</a>', 'Guide to Victoria\'s Caravan Park Regulations - September 2011', '', 'publish', 'closed', 'closed', '', 'guide-to-victorias-caravan-park-regulations-september-2011', '', '', '2016-02-26 06:52:49', '2016-02-26 06:52:49', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=971', 0, 'information-topics', '', 0),
