(992, 1, '2016-02-26 11:48:53', '2016-02-26 11:48:53', 'In accordance with the Residential Tenancies (Caravan Parks and Movable Dwellilngs Registration and Standards ( Regulations 1999, Councils must consult CFA regarding certain fire safety matters in caravan parks. CFA Officers use the CFA Caravan park Fire Safety Guidelines to assess new and existing caravan parks whether applications are referred by Councils or requested separately by caravan park owners/operators. Upon application, CFA will assess and report on fire safety in individual caravan parks including associated emergency management plans.\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/caravan-park-fire-safety-guideline-web.pdf">Caravan Park Fire Safety Guidelines Guidelines - Revised May 2012</a>', 'Caravan Park Fire Safety Guidelines', '', 'publish', 'closed', 'closed', '', 'caravan-park-fire-safety-guidelines', '', '', '2016-02-26 11:48:53', '2016-02-26 11:48:53', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=992', 0, 'information-topics', '', 0),
