(994, 1, '2016-02-26 11:51:18', '2016-02-26 11:51:18', 'Please find enclosed a link to the CFA website to the Caravan Park Guidelines.\r\n\r\n<a href="http://www.cfa.vic.gov.au/plan-prepare/caravan-park-fire-safety/">http://www.cfa.vic.gov.au/plan-prepare/caravan-park-fire-safety/</a>\r\n\r\nBoth version of the guideline are there, the hyperlinked versions and the print friendly version.\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Checklist.pdf">Caravan Park Fire Safety Checklist</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/PP-Fire-Separation.pdf">PP1 - Fires Access &amp; Separations</a>', 'Caravan Park Fire Safety', '', 'publish', 'closed', 'closed', '', 'caravan-park-fire-safety', '', '', '2016-02-26 11:51:18', '2016-02-26 11:51:18', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=994', 0, 'information-topics', '', 0),
