(1000, 1, '2016-02-26 11:53:09', '2016-02-26 11:53:09', 'In addition, the Chief Officer has the power to inspect existing buildings and identify any issues associated with maintenance of essential safety measures and recommend fire safety elements are upgraded or modified. Typically these inspections are programmed based on risk and resource allocation and coordinated proactively in conjunction with Councils Municipal Building Surveyor.', 'General Fire Safety Inspections', '', 'publish', 'closed', 'closed', '', 'general-fire-safety-inspections', '', '', '2016-02-26 11:53:09', '2016-02-26 11:53:09', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=1000', 0, 'information-topics', '', 0),
