(1004, 1, '2016-02-26 11:58:17', '2016-02-26 11:58:17', 'For further advice regarding regulatory fire safety matters, CFA recommends that you contact a registered building practitiioner in the category of Building Surveyor or Fire Safety Engineer in the first instance. Additional concerns in relation to general fire safety matters in existing buildings may be reported to the Fire Safety Officer at your local CFA Region office. For more information, contact the Fire Safety section at CFA HQ or the Fire Safety Officer at your local CFA Region office.\r\n\r\n<a href="http://www.cfa.vic.gov.au/about/locations/locations.htm">http://www.cfa.vic.gov.au/about/locations/locations.htm</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/cfa_can_I_cant_I_brochure_0.pdf">CFA - Can I Can\'t I Brochure</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Maintenance-of-Fire-Safety-Equipment_0.pdf">Maintenance of Fire Safety Equipment</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/TESTING-AND-TAGGING-OF-PORTABLE-FIRE-EXTINGUISHERS.pdf">Testing &amp; Tagging Requirements</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Lighting-of-Fires-in-Caravan-Parks-on-Total-Fire-Ban-Days.pdf">Lighting of Fires in Caravan Parks on Total Fire Ban Days</a>', 'Further Advice', '', 'publish', 'closed', 'closed', '', 'further-advice', '', '', '2016-02-26 11:58:17', '2016-02-26 11:58:17', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=1004', 0, 'information-topics', '', 0),
