(1016, 1, '2016-02-26 12:05:36', '2016-02-26 12:05:36', 'The information about the Crown land caravan and camping park survey 2012 has been published on DSE\'s website, and we will be sending letters today to all relevant Committees of Management (CoM) asking them to complete the survey, with input from lessees where applicable.\r\nThe survey has been developed with the assistance of the Crown land Caravan and Camping Parks Reference Group, which includes membership from CoMs, lessees and Regional Services Division.\r\nA link to the survey information on DSE\'s web page is provided below, as is the relevant factsheet which may be of use if your office receives queries.\r\n<a href="http://www.dse.vic.gov.au/recreation-and-tourism/crown-land-caravan-and-camping-parks-home-page/caravan-and-camping-parks-survey-2012"> Crown land caravan and camping parks survey 2012</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/FAQ-How-To-Complete-The-Caravan-Parks-Survey-2012.pdf">DSE FAQ - How to complete Crown Land Park Survey</a>', 'Crown Land Caravan and Camping Parks Survey 2012', '', 'publish', 'closed', 'closed', '', 'crown-land-caravan-and-camping-parks-survey-2012', '', '', '2016-02-26 12:05:36', '2016-02-26 12:05:36', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=1016', 0, 'information-topics', '', 0),
