(1064, 1, '2016-02-26 12:48:10', '2016-02-26 12:48:10', '<strong>Section 4.1</strong>\r\n\r\n<a href="http://www.cfa.vic.gov.au/documents/guidelines_caravan_parks.pdf">Click to <strong><em>here</em></strong> to download a copy from the CFA website.</a>\r\n\r\n<strong>4.2 - Caravan Parks, Fire Restrictions &amp; Total Fire Bans - use of various appliances in caravan parks during declared Fire Danger Periods and Total Fire Bans.</strong>\r\n\r\n<a href="http://www.cfa.vic.gov.au/restrictions/documents/tfb-caravans.pdf">Click to <em><strong>here</strong></em> to download a copy from the CFA website.</a>\r\n\r\n<strong>4.3 - Can I or Can\'t I - rules for use of fires during the Fire Danger Period, or on days of Total Fire Ban.</strong>\r\n\r\n<a href="http://www.cfa.vic.gov.au/restrictions/documents/can_i_cant_i/can_i_english.pdf">Click to <em><strong>here</strong></em> to download a copy from the CFA website.</a>\r\n\r\n<strong>4.4 - Building in a Wildfire Management Overlay.</strong>\r\n\r\n<a href="http://www.cfa.vic.gov.au/firesafety/buildingandregulations/documents/wmo_applicants_workbook.pdf">Click to <em><strong>here</strong></em> to download a copy from the CFA website.</a>\r\n\r\n<strong>4.5 - Know Your Total Fire Ban District.</strong>\r\n\r\n<a href="http://www.cfa.vic.gov.au/restrictions/documents/know_your_TFB_district.pdf">Click to <em><strong>here</strong></em> to download a copy from the CFA website.</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/R_Fire_Ready_Kit_living-in-Bush.pdf">4.6 Fire Ready Kit</a>', 'Section 4 - Reference Documents', '', 'publish', 'closed', 'closed', '', 'section-4-reference-documents', '', '', '2016-02-26 12:48:10', '2016-02-26 12:48:10', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=1064', 0, 'information-topics', '', 0),
(1065, 1, '2016-02-26 12:50:11', '2016-02-26 12:50:11', 'VicParks is grateful for the support of the SES to our Parks for providing the following information to assist parks with their Emergency Management Plans. The following information was provided by the SES at our regional workshops, this also includes their presentation at the workshop.\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/SES-Caravan-Park-Risk-Assessment.doc">SES Caravan Park Risk Assessment 2011</a>\r\n\r\nThe fact sheet attached provides information for caravan park owner/operators about emergency management planning. It provides details on the new online template designed by SES to assist caravan park develop an emergency management plan as well as general emergency information.\r\n\r\nhttp://www.ses.vic.gov.au/caravanparks\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Caravan-park-tool-Fact-Sheet.pdf">SES - Caravan Park Tool Fact Sheet</a>', 'SES - Emergency Management Planning', '', 'publish', 'closed', 'closed', '', 'ses-emergency-management-planning', '', '', '2016-02-26 12:50:11', '2016-02-26 12:50:11', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=1065', 0, 'information-topics', '', 0),
