(1193, 1, '2016-02-26 15:09:41', '2016-02-26 15:09:41', 'Please find attached the LPG pricing variation for the month of November 2015 - effective as from 01 December 2015. This month\'s increase was driven by tightening Propane supply for November / December and positive sentiment around increasing demand as the Northern Hemisphere heads towards winter ... The Saudi Aramco Propane Contract Price (CP) is now at USD395 per tonne (up from USD360/tonne). This CP increase was partly offset by an improvement in the AUD exchange rate.\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas_December-2015_0.pdf">LPG prices effective 1 December 2015</a>\n\n<hr />\n\nPlease find attached the LPG pricing variation for the month of October 2015 - effective as from 01 November 2015.\n\nThis month\'s increase was driven by the rebound in oil prices together with the diversion of some US exports to Europe and some signs of demand for stock building associated with the the low September CP.   The Saudi Aramco Propane Contract Price (CP) is now at USD360 per tonne (up from USD315/tonne).  This CP increase was further negatively impacted by the continuing deterioration in the AUD exchange rate.\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas_November-2015.pdf">LPG prices - Effective 1 November 2015</a>\n\n<hr />\n\nPlease find attached the LPG pricing variation for the month of September 2015 ...\n\nThis month\'s decrease was again due to lacklustre demand and ample supply - combined with a continuing fall in oil prices over the month.  The Saudi Aramco Propane Contract Price (CP) is now at USD315 per tonne (down from USD365/tonne) - lowest level since approx 2004.  This CP decrease was partly offset by a continuing deterioration in the AUD exchange rate.\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas_october-2015.pdf">LPG prices - Effective 1 October 2015</a>\n\n<hr />\n\nThis month we have two factors which affect the August 2015 pricing:-\n<ol>\n	<li>Annual review of base price to allow for the Consumer Price Index (C.P.I.) variation.</li>\n	<li>Monthly producer pricing variation.</li>\n</ol>\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas_September-2015_1.pdf">LPG prices - Effective 1 September 2015</a>\n\n<hr />\n\nPlease find attached the LPG pricing variation for the month of July 2015  ... effective from 1st August 2015\n\nThis month\'s insignificant increase was due to soft demand from the Northern Hemisphere summer and ample supply with record US exports flooding the market.  The fall in oil prices towards month end added to downward price pressure.  The Saudi Aramco Propane Contract Price (CP) is now at USD395 per tonne (down from USD405/tonne).  This CP decrease was fully offset by a deterioration in the AUD exchange rate.\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas_August-2015.pdf">LPG prices - Effective 1 August 2015</a>\n\n<hr />\n\nPlease find attached the LPG pricing variation for the month of June 2015 .. as always these rates are deferred one month (in arrears) and will be applicable as from 01/07/2015.\n\nThis month\'s decrease was due to lacklustre demand as the Northern Hemisphere enters summer.  Low LPG prices in the US and bullish sentiment around record US exports to the major eastern markets continuing added to downward price pressures. The Saudi Aramco Propane Contract Price (CP) is now at USD405 per tonne (down from USD465/tonne).  This CP decrease was also favourably impacted by an improvement in the AUD exchange rate.\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas_July-2015.pdf">LPG prices - Effective 1 July 2015</a>\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas_May-2015.pdf">LPG prices effective 1 June 2015</a>\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas_April-2015_0.pdf">LPG prices effect 1 May 2015</a>\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas_April-2015.pdf">LPG Prices Effective 1 April 2015</a>\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas-March-2015.pdf">LPG Prices - Effective 1 March 2015</a>\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas-February-2015.pdf">LPG Prices effective 1 February 2015</a>\n\n<a href="http://vicparks.dev/app/uploads/2016/02/Elgas_Dec_2014.pdf">LPG prices - Effective 1 January 2015</a>', '2015', '', 'inherit', 'closed', 'closed', '', '1177-autosave-v1', '', '', '2016-02-26 15:09:41', '2016-02-26 15:09:41', '', 1177, 'http://vicparks.dev/2016/02/1177-autosave-v1/', 0, 'revision', '', 0),
