(1295, 1, '2016-02-27 12:57:06', '2016-02-27 12:57:06', 'Due to the different reservation systems that people hold, we have a few different processes for participation. NewBook: consent form for NewBook members RMS9 must consent within their individual online system. This is a once only set-up process which will take a couple of minutes at most. Non cloud-based systems: CIAA are looking into options for those parks who are not part of NewBook or RMS9 to ensure that correct data is received while maintaining privacy. If this applies to your park please complete and return the attached register of interest form and forward directly to CIAA to keep on file until they a resolution has been confirmed. For further information. Jessica Adams Special Projects Caravan Industry Association of Australia Phone: 07 3262 6566 Fax: 07 3262 9989\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Consent-process-RMS9_0.pdf">RMS9 Cloud</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Consent-form-Newbook_0.pdf">NewBook eManagment Technology</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/VP-Non-Cloud-Register-Interest_0.pdf">Register of Interest</a>', 'Caravan Industry - Occupancy Data Collection Forms', '', 'publish', 'closed', 'closed', '', 'caravan-industry-occupancy-data-collection-forms', '', '', '2016-02-27 12:57:06', '2016-02-27 12:57:06', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=1295', 0, 'information-topics', '', 0),
