(1319, 1, '2016-02-27 13:50:43', '2016-02-27 13:50:43', 'Amendments have been made to the Part 4A Agreement to more closely align with the requirements of the Residential Tenancies Act (RTA), and also to provide some simplification of a few clauses, following feedback from members at the regional workshops held in October 2012.\r\n\r\nThe main amendments are:\r\n<ul>\r\n	<li>The Part 4A resident is now described in the Agreement as the Site Tenant, to more accurately reflect the terminology in the RTA</li>\r\n	<li>The termination clause has been simplified – the statement that the Park Owner can terminate on 365 days notice has removed to reflect the current anomaly in the RTA; it will be replaced when this anomaly is clarified.</li>\r\n	<li>Options for methods of calculating an increase in the rent have been reduced from 3 to 2 – future rent increases can be calculated using either CPI or any other non-CPI increase. The wording of the rent increase clauses has been simplified. It is important to note that irrespective of the method of increase adopted a complying notice of rent increase must be given.</li>\r\n	<li>A new Schedule 2 has been created, to incorporate the requirements of Section 206S. This new schedule details the various additional charges that the park owner may seek from the site tenant – eg, electricity, gas, water, visitor fees, key deposits, etc, and the payment schedules for these. We have tried to include all additional charges. There may be some which are not relevant to your park and others you charge that are not mentioned. This Schedule will need to be tailored to suit your individual park.</li>\r\n	<li>The provisions for the sale of a deceased site tenant’s home now allows for a total of 6 months for the executor to sell the home – 3 months to obtain probate, and a further 3 months to sell.</li>\r\n	<li>The requirement for site tenants to take out and keep current a public risk insurance policy has been removed.</li>\r\n</ul>\r\nVicParks recommends that this Agreement be used without any alteration; it has been prepared by legal experts and its clarity provides protection for both the park owner and the site tenant in any dispute.\r\n\r\n<strong>So what do the changes mean to you?</strong>\r\n\r\nThere is no need to replace the existing Agreements that have been signed with site tenants unless you wish to adopt the new agreement, but you should no longer require site tenants to keep a public risk insurance policy, and should also offer the new Schedule 2 to outline arrangements for payment by the site tenant of additional costs incurred such as electricity, visitors, etc.\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Part-4A-2014-08-26.pdf">Part 4A Agreement (revised September 2014)</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Schedule-1-2_0.doc">Part 4A Schedule - (Revised August 2014)</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Part-4A-Timelines_0_0.pdf">Part 4A Timelines</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Supporting-Document1-_-Acknowledgement-by-Resident_0.doc">Acknowledgement by Resident</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/VICTORIAN-CARAVAN-PARKS_-Cooling-off-notice_0.doc">Cooling Off Notice</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Notice-of-Rent-Increase-to-Site-Tenant_0.doc">Notice of Rent Increase to Site Tenant</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/Notice-of-rent-increase-to-site-tenant-1.doc">Consumer Affairs Victoria - Notice of Rent Increase</a>\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/VicParks-Snapshots_0.pdf">Termination of Part 4A Agreement</a>', 'VicParks Part 4A Agreement - (Revised February 2013)', '', 'publish', 'closed', 'closed', '', 'vicparks-part-4a-agreement-revised-february-2013', '', '', '2016-02-27 13:50:43', '2016-02-27 13:50:43', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=1319', 0, 'information-topics', '', 0),
