(1356, 1, '2016-02-27 14:32:54', '2016-02-27 14:32:54', '<em>Do you have a property with less than 15 rooms? Are you looking for a better way to store and track your occupancy, room rates and revenue statistics, in addition to monitoring your monthly business performance and comparing your pricing to similar properties in your region? If so, the Small Scale Accommodation Survey will be a useful tool for you.</em>\r\n\r\nSince the Federal Government ceased to fund data collection for the caravanning and camping sector under the ABS Survey of Tourist Accommodation, it has meant that tourism accommodation data being fed into public policy has only captured hotels, motels, and serviced apartments over 15 rooms since June 2010 <strong>presenting a serious disadvantage to the industry in the formation of policy.</strong>\r\n\r\nThe Small Scale Accommodation Survey (SSAS) is a free, online business tool that lets you compare your business performance with similar properties. After inputting your monthly data via a secure webpage you will receive an electronic report for your own property as well as access to charts and tables that allow you to compare your property to others. Your own data is not disclosed to other participants in the SSAS, only aggregated as part of a broader set of comparison information segmented by sector and tourism regions.\r\n\r\nThe SSAS is an initiative of Tourism 2020 managed by Tourism Research Australia (TRA) and being developed by STR Global. More information on the SSAS and how to register can be found at <a href="http://www.ret.gov.au/tra">www.ret.gov.au/tra</a> or contact <a href="mailto:tourism.research@ret.gov.au">tourism.research@ret.gov.au</a>.\r\n\r\n<a href="http://vicparks.dev/app/uploads/2016/02/29Nov2012_Calling-All-Small-Operators.pdf">Calling All Park Operators</a>', 'Information Sheet - Small Scale Accommodation Survey', '', 'publish', 'closed', 'closed', '', 'small-scale-accommodation-survey', '', '', '2016-02-27 14:32:54', '2016-02-27 14:32:54', '', 0, 'http://vicparks.dev/?post_type=information-topics&#038;p=1356', 0, 'information-topics', '', 0),
