(1618, 1, '2016-03-04 03:11:31', '2016-03-04 03:11:31', '&nbsp;\r\n\r\nWe are looking forward to our annual conference - it\'s going to be a fantastic event, with a large exciting range of speakers.', 'Conference', '', 'inherit', 'closed', 'closed', '', '239-revision-v1', '', '', '2016-03-04 03:11:31', '2016-03-04 03:11:31', '', 239, 'http://vicparks.dev/2016/03/239-revision-v1/', 0, 'revision', '', 0),
(1619, 1, '2016-03-04 03:16:09', '2016-03-04 03:16:09', 'If you operate a caravan park or work in a related industry or are seeking employment within the caravan park industry and would like to join Vic Parks (Victorian Caravan Parks Association) and start enjoying the many benefits our membership offers, please complete your details below and we will contact you regarding membership.\r\n\r\nIf you are a Supplier and would like to register your company interest in our trade exhibition to be held at the Pullman Melbourne, 22-24 August 2016.\r\n\r\nPlease send through a request for further information on the form below', 'Why Join?', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2016-03-04 03:16:09', '2016-03-04 03:16:09', '', 2, 'http://vicparks.dev/2016/03/2-revision-v1/', 0, 'revision', '', 0),
(1620, 1, '2016-03-09 00:37:21', '2016-03-09 00:37:21', '<h3>The Victorian Caravan Parks Association was formed in 1964 to protect, promote and advance the caravan park industry.</h3>\nIn 1985, the Association became an incorporated body.\n\nThe Association is run by a Committee of Management. Each of the 11 divisions, into which the State of Victoria is divided, is entitled to have 1 or more delegates depending on the number of members in the division, representing that division on the Committee of Management.Divisions meet on a regular basis and in addition to the work undertaken by the Association at its central office in Melbourne, the divisions enable park proprietors in any given area to discuss matters of particular mutual concern to themselves such as promotion of their parks in their own locality and the promotion of tourism to their area.\n\nMembership has grown in recent years and now represents a significant share of the total number of caravan parks in Victoria. Membership covers residential parks, tourist parks, annual parks and many which are a mixture of all three.\n\n<strong>The objectives of the Victorian Caravan Parks Association of Victoria are to:</strong>\n<ul>\n	<li>encourage participation of the whole industry</li>\n	<li>provide a common meeting ground for members</li>\n	<li>facilitate the collection and expression of representative opinion regarding matters affecting the industry, whether it be the Government,</li>\n	<li>councils, authorities or other bodies</li>\n	<li>establish and maintain satisfactory and harmonious relations with other sections of the industry and commerce for the purpose of furthering and developing the caravan park industry</li>\n	<li>collect and disseminate relevant statistics technical and other matters to members</li>\n	<li>make every effort to inform members of policies and action taken in the interest of members and the industry</li>\n	<li>encourage and participate in education and training relevant to the development of the industry</li>\n</ul>', 'About', '', 'inherit', 'closed', 'closed', '', '23-autosave-v1', '', '', '2016-03-09 00:37:21', '2016-03-09 00:37:21', '', 23, 'http://vicparks.dev/2016/03/23-autosave-v1/', 0, 'revision', '', 0),
