(1663, 1, '2016-03-08 23:58:53', '2016-03-08 23:58:53', '<strong>VicParks strongly</strong> recommends that our members support our suppliers (Associate members) when considering purchases or services required for your park.\n\nFor a complete list of VicParks Preferred Suppliers <strong><a href="http://vicparks.dev/preferred-suppliers/">click here</a></strong>\n\n&nbsp;', 'Preferred Suppliers to the Caravan Park Industry', '', 'inherit', 'closed', 'closed', '', '1376-autosave-v1', '', '', '2016-03-08 23:58:53', '2016-03-08 23:58:53', '', 1376, 'http://vicparks.dev/2016/03/1376-autosave-v1/', 0, 'revision', '', 0),
